INSERT INTO `think_article` VALUES (46, 'PHP人民币金额数字转中文大写的函数代码', 5, 'http://p73q8jzf0.bkt.clouddn.com/01552e500c1c2a67428f5bd180f3144c.pg,http://p73q8jzf0.bkt.clouddn.com/0782ffb41c9f5f9d81870b899367794f.png,http://p73q8jzf0.bkt.clouddn.com/0574ce0ac7c4c1f92eb506e2c6919365.jpg,http://p73q8jzf0.bkt.clouddn.com/1775c5ebcb13530d09d0bd613ff1fed6.png', '在网上看到一个非常有趣的PHP人民币金额数字转中文大写的函数，其实质就是数字转换成中文大写，测试了一下，非常有趣，随便输个数字，就可以将其大写打印出来，新手朋友们试一下吧', '人民币转大写', '<p>在网上看到一个非常有趣的PHP人民币金额数字转中文大写的函数，其实质就是数字转换成中文大写，测试了一下，非常有趣，随便输个数字，就可以将其大写打印出来，新手朋友们试一下吧</p><pre class=\"brush:php;toolbar:false\">/**\r\n*数字金额转换成中文大写金额的函数\r\n*String&nbsp;Int&nbsp;&nbsp;$num&nbsp;&nbsp;要转换的小写数字或小写字符串\r\n*return&nbsp;大写字母\r\n*小数位为两位\r\n**/\r\nfunction&nbsp;get_amount($num){\r\n$c1&nbsp;=&nbsp;&quot;零壹贰叁肆伍陆柒捌玖&quot;;\r\n$c2&nbsp;=&nbsp;&quot;分角元拾佰仟万拾佰仟亿&quot;;\r\n$num&nbsp;=&nbsp;round($num,&nbsp;2);\r\n$num&nbsp;=&nbsp;$num&nbsp;*&nbsp;100;\r\nif&nbsp;(strlen($num)&nbsp;&gt;&nbsp;10)&nbsp;{\r\nreturn&nbsp;&quot;数据太长，没有这么大的钱吧，检查下&quot;;\r\n}&nbsp;\r\n$i&nbsp;=&nbsp;0;\r\n$c&nbsp;=&nbsp;&quot;&quot;;\r\nwhile&nbsp;(1)&nbsp;{\r\nif&nbsp;($i&nbsp;==&nbsp;0)&nbsp;{\r\n$n&nbsp;=&nbsp;substr($num,&nbsp;strlen($num)-1,&nbsp;1);\r\n}&nbsp;else&nbsp;{\r\n$n&nbsp;=&nbsp;$num&nbsp;%&nbsp;10;\r\n}&nbsp;\r\n$p1&nbsp;=&nbsp;substr($c1,&nbsp;3&nbsp;*&nbsp;$n,&nbsp;3);\r\n$p2&nbsp;=&nbsp;substr($c2,&nbsp;3&nbsp;*&nbsp;$i,&nbsp;3);\r\nif&nbsp;($n&nbsp;!=&nbsp;&#39;0&#39;&nbsp;||&nbsp;($n&nbsp;==&nbsp;&#39;0&#39;&nbsp;&amp;&amp;&nbsp;($p2&nbsp;==&nbsp;&#39;亿&#39;&nbsp;||&nbsp;$p2&nbsp;==&nbsp;&#39;万&#39;&nbsp;||&nbsp;$p2&nbsp;==&nbsp;&#39;元&#39;)))&nbsp;{\r\n$c&nbsp;=&nbsp;$p1&nbsp;.&nbsp;$p2&nbsp;.&nbsp;$c;\r\n}&nbsp;else&nbsp;{\r\n$c&nbsp;=&nbsp;$p1&nbsp;.&nbsp;$c;\r\n}&nbsp;\r\n$i&nbsp;=&nbsp;$i&nbsp;+&nbsp;1;\r\n$num&nbsp;=&nbsp;$num&nbsp;/&nbsp;10;\r\n$num&nbsp;=&nbsp;(int)$num;\r\nif&nbsp;($num&nbsp;==&nbsp;0)&nbsp;{\r\nbreak;\r\n}&nbsp;\r\n}\r\n$j&nbsp;=&nbsp;0;\r\n$slen&nbsp;=&nbsp;strlen($c);\r\nwhile&nbsp;($j&nbsp;&lt;&nbsp;$slen)&nbsp;{\r\n$m&nbsp;=&nbsp;substr($c,&nbsp;$j,&nbsp;6);\r\nif&nbsp;($m&nbsp;==&nbsp;&#39;零元&#39;&nbsp;||&nbsp;$m&nbsp;==&nbsp;&#39;零万&#39;&nbsp;||&nbsp;$m&nbsp;==&nbsp;&#39;零亿&#39;&nbsp;||&nbsp;$m&nbsp;==&nbsp;&#39;零零&#39;)&nbsp;{\r\n$left&nbsp;=&nbsp;substr($c,&nbsp;0,&nbsp;$j);\r\n$right&nbsp;=&nbsp;substr($c,&nbsp;$j&nbsp;+&nbsp;3);\r\n$c&nbsp;=&nbsp;$left&nbsp;.&nbsp;$right;\r\n$j&nbsp;=&nbsp;$j-3;\r\n$slen&nbsp;=&nbsp;$slen-3;\r\n}&nbsp;\r\n$j&nbsp;=&nbsp;$j&nbsp;+&nbsp;3;\r\n}&nbsp;\r\nif&nbsp;(substr($c,&nbsp;strlen($c)-3,&nbsp;3)&nbsp;==&nbsp;&#39;零&#39;)&nbsp;{\r\n$c&nbsp;=&nbsp;substr($c,&nbsp;0,&nbsp;strlen($c)-3);\r\n}\r\nif&nbsp;(empty($c))&nbsp;{\r\nreturn&nbsp;&quot;零元整&quot;;\r\n}else{\r\nreturn&nbsp;$c&nbsp;.&nbsp;&quot;整&quot;;\r\n}\r\n}</pre><p>最终实现效果：</p><p><img src=\"/Uploads/ueditor/2015-12-28/1451310141372440.png\" title=\"1451310141372440.png\" alt=\"1449026968974428.png\"/></p>', 0, 1, 1, 'Win 8.1', '轮回', '124.152.7.106', 1449026848, 1526452832, 1, 'http://health.xuanwumobile.com/uploads/music/20180929/4e190d5d24aa5f93b7eb08aafa33017f.mp3');
INSERT INTO `think_article` VALUES (47, 'Windows下mysql忘记密码的解决方法', 1, 'http://p73q8jzf0.bkt.clouddn.com/01552e500c1c2a67428f5bd180f3144c.png,http://p73q8jzf0.bkt.clouddn.com/0782ffb41c9f5f9d81870b899367794f.png,http://p73q8jzf0.bkt.clouddn.com/0574ce0ac7c4c1f92eb506e2c6919365.jpg,http://p73q8jzf0.bkt.clouddn.com/1775c5ebcb13530d09d0bd613ff1fed6.png', 'Windows下mysql忘记密码的解决方法', 'mysql', '<p>方法一：</p><p>1、在DOS窗口下输入</p><pre>net&nbsp;stop&nbsp;mysql5</pre><p>&nbsp;</p><p>或</p><pre>net&nbsp;stop&nbsp;mysql</pre><p>&nbsp;</p><p>2、开一个DOS窗口，这个需要切换到mysql的bin目录。<br/>一般在bin目录里面创建一个批处理1.bat,内容是cmd.exe运行一下即可就切换到当前目录，然后输入</p><pre>mysqld-nt&nbsp;--skip-grant-tables;</pre><p>&nbsp;</p><p>3、再开一个DOS窗口</p><pre>mysql&nbsp;-u&nbsp;root</pre><p>&nbsp;</p><p>4、输入：</p><pre>use&nbsp;mysql&nbsp;\r\nupdate&nbsp;user&nbsp;set&nbsp;password=password(&quot;new_pass&quot;)&nbsp;where&nbsp;user=&quot;root&quot;;&nbsp;\r\nflush&nbsp;privileges;&nbsp;\r\nexit</pre><p>&nbsp;</p><p>5、使用任务管理器，找到mysqld-nt的进程，结束进程&nbsp;<br/>或下面的步骤<br/>1，停止MYSQL服务，CMD打开DOS窗口，输入 net stop mysql&nbsp;<br/>2，在CMD命令行窗口，进入MYSQL安装目录 比如E:Program FilesMySQLMySQL Server 5.0bin&nbsp;<br/>示范命令:&nbsp;<br/>输入 e:回车,&nbsp;<br/>输入cd &quot;E:Program FilesMySQLMySQL Server 5.0bin&quot;&nbsp;<br/>注意双引号也要输入,这样就可以进入Mysql安装目录了.&nbsp;<br/>3，进入mysql安全模式，即当mysql起来后，不用输入密码就能进入数据库。&nbsp;<br/>命令为：</p><pre>mysqld-nt&nbsp;--skip-grant-tables</pre><p>&nbsp;</p><p>4，重新打开一个CMD命令行窗口，输入</p><p>mysql -uroot -p，使用空密码的方式登录MySQL（不用输入密码，直接按回车）</p><p>5，输入以下命令开始修改root用户的密码（注意：命令中mysql.user中间有个“点”）</p><p>mysql.user：数据库名.表名<br/>mysql&gt; update mysql.user set password=PASSWORD(&#39;新密码&#39;) where User=&#39;root&#39;;&nbsp;<br/>6，刷新权限表&nbsp;<br/>mysql&gt; flush privileges;&nbsp;<br/>7，退出&nbsp;<br/>mysql&gt; quit</p><p><br/>这样MYSQL超级管理员账号 ROOT已经重新设置好了，接下来 在任务管理器里结束掉 mysql-nt.exe 这个进程，重新启动MYSQL即可！</p><p>（也可以直接重新启动服务器）&nbsp;<br/>MYSQL重新启动后，就可以用新设置的ROOT密码登陆MYSQL了！</p><p>方法二：</p><p>首先在 MySQL的安装目录下 新建一个pwdhf.txt, 输入文本：</p><pre>SET&nbsp;PASSWORD&nbsp;FOR&nbsp;&#39;root&#39;@&#39;localhost&#39;&nbsp;=&nbsp;PASSWORD(&#39;*****&#39;);</pre><p>&nbsp;</p><p>红色部份为 需要设置的新密码&nbsp;<br/>用windows服务管理工具或任务管理器来停止MySQL服务 (任务管理器K掉 mysqld-nt 进程)&nbsp;<br/>Dos命令提示符到 MySQL安装目录下的bin目录 如我的是</p><p>D:Program FilesMySQLMySQL Server 5.1bin&nbsp;<br/>然后运行：</p><pre>mysqld-nt&nbsp;--init-file=../pwdhf.txt</pre><p>&nbsp;</p><p>执行完毕， 停止MySQL数据库服务 (任务管理器K掉 mysqld-nt 进程)，然后再重新以正常模式启动MYSQL 即可</p><hr style=\"color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\"/><p>mysql5.1或以上</p><p>1、 首先检查mysql服务是否启动，若已启动则先将其停止服务，可在开始菜单的运行，使用命令：</p><pre>net&nbsp;stop&nbsp;mysql</pre><p>&nbsp;</p><p>2、打开第一个cmd窗口，切换到mysql的bin目录，运行命令：</p><pre>mysqld&nbsp;--defaults-file=&quot;C:Program&nbsp;FilesMySQLMySQL&nbsp;Server&nbsp;5.1my.ini&quot;&nbsp;--console&nbsp;--skip-grant-tables</pre><p>&nbsp;</p><p>注释：</p><p>该命令通过跳过权限安全检查，开启mysql服务，这样连接mysql时，可以不用输入用户密码。&nbsp;<br/>&nbsp;</p><p>&nbsp;</p><p>3、打开第二个cmd窗口，连接mysql：</p><p>输入命令：</p><pre>mysql&nbsp;-uroot&nbsp;-p</pre><p>出现：</p><p>Enter password:</p><p>在这里直接回车，不用输入密码。</p><p>然后就就会出现登录成功的信息，</p><p>&nbsp;</p><p>&nbsp;</p><p>4、使用命令：</p><pre>show&nbsp;databases;</pre><p>&nbsp;</p><p>&nbsp;</p><p>5、使用命令切换到mysql数据库：</p><pre>use&nbsp;mysql;</pre><p>&nbsp;</p><p>6、使用命令更改root密码为123456：</p><pre>UPDATE&nbsp;user&nbsp;SET&nbsp;Password=PASSWORD(&#39;123456&#39;)&nbsp;where&nbsp;USER=&#39;root&#39;;</pre><p>&nbsp;</p><p>&nbsp;</p><p>7、刷新权限：</p><pre>FLUSH&nbsp;PRIVILEGES;</pre><p>&nbsp;</p><p>8、然后退出，重新登录：</p><p>quit</p><p>重新登录：</p><pre>mysql&nbsp;-uroot&nbsp;-p</pre><p>&nbsp;</p><p>9、出现输入密码提示，输入新的密码即可登录：</p><p>Enter password: ***********</p><p>显示登录信息： 成功&nbsp; 就一切ok了</p><p>&nbsp;</p><p>10、重新启动mysql服务</p><pre>net&nbsp;start&nbsp;mysql</pre><p><br/></p>', 0, 0, 0, 'Win 8.1', '轮回', '0.0.0.0', 1450339377, 1526452810, 1, 'http://health.xuanwumobile.com/uploads/music/20180929/4e190d5d24aa5f93b7eb08aafa33017f.mp3');
INSERT INTO `think_article` VALUES (48, '禁止网页复制的代码', 1, 'http://p73q8jzf0.bkt.clouddn.com/01552e500c1c2a67428f5bd180f3144c.png,http://p73q8jzf0.bkt.clouddn.com/0782ffb41c9f5f9d81870b899367794f.png,http://p73q8jzf0.bkt.clouddn.com/0574ce0ac7c4c1f92eb506e2c6919365.jpg,http://p73q8jzf0.bkt.clouddn.com/1775c5ebcb13530d09d0bd613ff1fed6.png', '禁止网页复制的代码', '网页复制', '<p>今天做一网站项目时，客户要求让用户不能复制网站内容，网上搜索了一下，总结成以下二几行代码。其实吧，要是懂的人，这些都是浮云来的，客户就是要让一般人不能复制他的内容资料。</p><pre class=\"brush:html;toolbar:false\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 9.5px; list-style: none; border: 1px solid rgb(204, 204, 204); overflow: auto; font-family: Menlo, Monaco, Consolas, &#39;Courier New&#39;, monospace; font-size: 13px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; word-wrap: break-word; border-radius: 4px; background-color: rgb(245, 245, 245);\">&quot;&nbsp;_ue_custom_node_=&quot;true&quot;&gt;&lt;\r\ntitle\r\n&gt;禁止网页复制的代码&nbsp;&nbsp;网页禁止右键、禁止查看源代码、禁止复制的代码，试试你的右键、ctrl+c和ctrl+c吧~\r\n&nbsp;&nbsp;\r\n&nbsp;&nbsp;&quot;&nbsp;_ue_custom_node_=&quot;true&quot;&gt;</pre><p><br/></p>', 0, 1, 1, 'Win 8.1', '轮回', '0.0.0.0', 1450340150, 1529654137, 1, 'http://health.xuanwumobile.com/uploads/music/20180929/4e190d5d24aa5f93b7eb08aafa33017f.mp3');
