INSERT INTO `think_article_category` VALUES (1, '脚本专栏', 'スクリプト', 'script', 0, 1, 1, 1, 'スクリプト、python、DOS / BAT、vbs、perl、VBA、ruby、power shell、linux shell、Lua、Golang、Erlang', 'スクリプト言語は、拡張言語または動的言語とも呼ばれ、ソフトウェアアプリケーションを制御するために使用されるプログラミング言語です。スクリプトは通常、テキスト（ASCIIなど）で保存され、呼び出されたときにのみ解釈またはコンパイルされます。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (2, 'vbs', 'vbs', '', 1, 0, 1, 0, 'vbs,VBScript', 'VBSは、VisualBasicに基づくスクリプト言語です。 VBSのフルネームは次のとおりです。MicrosoftVisualBasicScriptEditon。 （Microsoft Visual BASICスクリプトバージョン）。\nその言語はVisualBasic（VB）に似ています', '/uploads/images/20211016\\b4d0b479dabb4bf93c1c3611d34fec66.jpg', '<h1>\n    vbs\n</h1>\n<p>\n   VBSは、VisualBasicに基づくスクリプト言語です。 VBSのフルネームは次のとおりです。MicrosoftVisualBasicScriptEdition。 （Microsoft Visual BASICスクリプトバージョン）。<br/>\n</p>\n<p>\n    その言語はVisualBasicに似ています（VB）\n</p>\n<p>\n    <strong>スクリプト言語の特徴は次のとおりです:</strong><br/>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            習得が容易\n        </p>\n    </li>\n    <li>\n        <p>\n            説明言語\n        </p>\n    </li>\n    <li>\n        <p>\n            統合された成熟したテクノロジー\n        </p>\n    </li>\n</ol>\n<p>\n   VBScriptは、Visual Basic Sc​​riptの略語、つまりVisual Basicスクリプト言語であり、VBSと略されることもあります。<br/>\n</p>\n<p>\n    VBScriptは、Microsoftによって開発されたスクリプト言語です。 VBScriptを使用すると、Windowsスクリプトホストを介してCOMを呼び出すことができるため、Windowsオペレーティングシステムで使用できるライブラリを使用できます。<br/>\n</p>\n<p>\n    VBScriptは通常、次の分野で使用されます。VBScriptは、Windowsオペレーティングシステムの反復タスクを完了するためによく使用されます。クライアントのWebブラウザにコマンドを送信するために使用されます。\n</p>\n<p>\n    この点で、VBSとJavaScriptは競合他社です。この記事の実験環境はWindowプラットフォームに基づいているため、互換性とパフォーマンスを向上させるためにVBScriptが選択されています。\n</p>');
INSERT INTO `think_article_category` VALUES (3, 'DOS/BAT', 'DOS/BAT', '', 1, 0, 1, 0, 'DOS、BAT、バッチ処理', 'ここでは主にDOSとバットに関する情報を紹介します。DOSとバッチ処理を学びたい友達はそれを学ぶことができます。', '/uploads/images/20211016\\03673b2472129357c1b2c6da02cfa2f7.png', '<h1>\n    DOS/BAT\n</h1>\n<p>\n    DOSは、Disk Operating Systemの略で、パーソナルコンピュータ上のオペレーティングシステムの一種です。 1981年から1995年までの15年間、ディスクオペレーティングシステムはIBMPC互換機市場で極めて重要な役割を果たしました。 さらに、Windows 95、Windows 98、WindowsMeなどのDOSベースのバージョンのMicrosoftWindowsが含まれている場合、それらの商用寿命は少なくとも2000年と見なすことができます。 それ以降のすべてのバージョンのMicrosoftでは、ディスクオペレーティングシステムは引き続き保持されます。\n</p>\n<p>\n    <strong>完全なDOSは5つの部分で構成されています：</strong>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            ブートプログラム（BOOT）：ディスクの最初のセクターはフォーマットプログラムによって直接書き込まれます。\n        </p>\n    </li>\n    <li>\n        <p>\n            基本的な入出力管理プログラム（PC-DOSはIBMBIO。COM、MS-DOSはIO.SYS）。\n        </p>\n    </li>\n    <li>\n        <p>\n            ファイル管理およびシステム関数呼び出しプログラム（PC-DOSはIBMDOS.COM、MS-DOSです。MSDOS.SYSです）。\n        </p>\n    </li>\n    <li>\n        <p>\n            コマンドハンドラー(COMMAND. COM)。\n        </p>\n    </li>\n    <li>\n        <p>\n            さまざまな外部コマンド：さまざまな補助機能を完了する実行可能ファイル。\n        </p>\n    </li>\n</ol>\n<p>\n    batファイルはdosの下のバッチファイルです。 バッチファイルは、1つ以上のコマンドを含むフォーマットされていないテキストファイルです。 そのファイル拡張子は.batまたは.cmdです。 コマンドプロンプトでバッチファイルの名前を入力するか、バッチファイルをダブルクリックすると、システムはcmd.exeを呼び出して、ファイル内の各コマンドを表示されている順序で実行します。 バッチファイル（バッチプログラムまたはスクリプトとも呼ばれます）を使用すると、日常のタスクや繰り返しのタスクを簡素化できます。\n</p>');
INSERT INTO `think_article_category` VALUES (4, 'python', 'python', '', 1, 0, 1, 0, 'Python、Pythonエントリ、Python開発、Pythonプログラミング', 'Pythonは、1989年にオランダのグイドヴァンロッサムによって発明されたオブジェクト指向のインタプリタコンピュータプログラミング言語です。Pythonは「エレガント」、「クリア」、「シンプル」と位置付けられているため、Pythonプログラムは常にシンプルで簡単に見えます。はい、初心者はPythonを学びます。 、始めるのが簡単なだけでなく、将来的には、非常に複雑なプログラムを書くことができます。', '/uploads/images/20211016\\52859da452e206da3d55744f6f5b6a05.png', '<h1>\n    python\n</h1>\n<p>\n    Python（発音：英語[ˈpaɪθən]、米国[ˈpaɪθɑ：n]）は、オブジェクト指向の文字通りのコンピュータープログラミング言語であり、強力な汎用言語です。20年近くの歴史があり、成熟しています。安定しています。 。 これには、多くの一般的なタスクを簡単に実行できる、完全で理解しやすい標準ライブラリが含まれています。 その構文は非常に単純で明確であり、他のほとんどのプログラミング言語とは異なり、インデントを使用してステートメントを定義します。\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            Pythonはインタプリタ言語です。これは、開発プロセスでコンパイルが行われないことを意味します。 PHPおよびPerl言語に似ています。\n        </p>\n    </li>\n    <li>\n        <p>\n            Pythonはインタラクティブな言語です。つまり、Pythonプロンプトでプログラムを直接実行し、インタラクティブに記述できます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Pythonはオブジェクト指向言語です。これは、Pythonが、コードがオブジェクトにカプセル化されるオブジェクト指向スタイルまたはプログラミング手法をサポートしていることを意味します。\n        </p>\n    </li>\n    <li>\n        <p>\n            Pythonは初心者向けの言語です。Pythonはジュニアプログラマー向けの優れた言語であり、単純なワードプロセッシングからWWWブラウザー、ゲームまで、幅広いアプリケーション開発をサポートします。\n        </p>\n    </li>\n</ol>\n<p>\n    Pythonは、命令型プログラミング、オブジェクト指向プログラミング、機能的プログラミング、アスペクト指向プログラミング、ジェネリックプログラミングなどの複数のプログラミングパラダイムをサポートしています。 Scheme、Ruby、Perl、Tclなどの動的言語と同様に、Pythonにはメモリ使用量を自動的に管理できるガベージコレクション機能があります。 システム管理タスクやネットワークプログラミングを処理するためのスクリプト言語としてよく使用されますが、さまざまな高レベルのタスクを完了するのにも非常に適しています。 Python仮想マシン自体は、ほぼすべてのオペレーティングシステムで実行できます。 py2exe、PyPy、PyInstallerなどのいくつかのツールを使用して、PythonソースコードをPythonインタープリターなしで実行できるプログラムに変換します。\n</p>');
INSERT INTO `think_article_category` VALUES (5, 'perl', 'perl', '', 1, 0, 1, 0, 'perl、perlプログラミング、perl開発、perlインストール', '機能豊富なコンピュータープログラミング言語であるPerlは、100を超えるコンピュータープラットフォームで実行され、メインフレームからポータブルデバイス、ラピッドプロトタイピングから大規模でスケーラブルな開発まで、幅広いアプリケーションに適用できます。', '/uploads/images/20211016\\3a401765882545ed70e0f6f50ef86a15.png', '<h1>\n    perl\n</h1>\n<p>\n    Perlは、Larry Wallによって設計され、彼によって絶えず更新および保守されているプログラミング言語です。<br/>\n</p>\n<p>\n    Perlには、高級言語（Cなど）の能力と柔軟性があります。 実際、ご覧のとおり、その機能の多くはC言語から借用されています。<br/>\n</p>\n<p>\n    Perlはスクリプト言語と同じです。Perlはコードを実行するためにコンパイラーとリンカーを必要としません。あなたがしなければならないのはプログラムを書いてPerlにそれを実行するように指示することだけです。 これは、Perlが小さなプログラミング問題の迅速な解決策や、潜在的な解決策をテストするための大きなイベントのプロトタイプの作成に理想的であることを意味します。<br/>\n</p>\n<p>\n    Perlは、スクリプト言語のすべての機能（sedやawkなど）を提供しますが、それらにはない多くの機能も備えています。 Perlは、sedからPerlおよびawkからPerlへのトランスレータもサポートしています。<br/>\n</p>\n<p>\n    要するに、PerlはCと同じくらい強力で、awkやsedなどのスクリプト言語と同じくらい便利です。\n</p>\n<p>\n    <strong>Perlの利点<br/></strong>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            CやPascalなどの高級言語と比較して、Perl言語は、汎用変数、動的配列、ハッシュテーブルなどのより便利なプログラミング要素を直接提供します。\n        </p>\n    </li>\n    <li>\n        <p>\n            Perlは、動的言語の強力で柔軟な特性を備えており、C / C ++、Basic、Pascalなどの言語から文法規則を借用して、多くの冗長な文法を提供します。\n        </p>\n    </li>\n    <li>\n        <p>\n            変数型を統合し、操作の詳細を隠すという点で、Perlは他の高級言語（Pythonなど）よりも優れた仕事をします。\n        </p>\n    </li>\n    <li>\n        <p>\n            他の言語から多くの文法を借りた結果、他のプログラミング言語からPerlに切り替えるプログラマーは、プログラムをすばやく作成してタスクを完了することができるため、Perlは使いやすい言語になります。\n        </p>\n    </li>\n    <li>\n        <p>\n            Perlは拡張可能であり、CPAN（Comprehensive Perl Archive Network）中央ウェアハウスを通じて必要な多くのモジュールを見つけることができます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Perlのmod_perlモジュールを使用すると、ApacheWebサーバーでPerlインタープリターを使用できます。\n        </p>\n    </li>\n</ol>');
INSERT INTO `think_article_category` VALUES (6, 'VBA', 'VBA', '', 1, 0, 2, 0, 'VBA、vba開発、vbaチュートリアル、vbaリソース', 'Visual Basic for Applications（VBA）は、Visual Basicのマクロ言語であり、デスクトップアプリケーションで一般的な自動化（OLE）タスクを実行するためにMicrosoftによって開発されたプログラミング言語です。 主に、Windowsアプリケーション、特にMicrosoftOfficeソフトウェアの機能を拡張するために使用できます。 また、アプリケーションを視覚化するための基本的なスクリプトとも言えます。', '/uploads/images/20211017\\c6ff3807e708553abc20ad63071e7012.png', '<h1>\n    VBA\n</h1>\n<p>\n    Visual Basic for Applications（VBA）は、Visual Basicのマクロ言語であり、デスクトップアプリケーションで一般的な自動化（OLE）タスクを実行するためにMicrosoftによって開発されたプログラミング言語です。 主に、Windowsアプリケーション、特にMicrosoftOfficeソフトウェアの機能を拡張するために使用できます。 また、アプリケーションを視覚化するための基本的なスクリプトとも言えます。 この言語は1993年にMicrosoftによって開発され、共通の自動化言語を共有していました-------- Visual Basic For Application（VBA）。実際、VBAはVBアプリケーションに寄生するバージョンです。 1994年にMicrosoftがリリースしたExcel5.0バージョンでは、VBAのマクロ機能を備えています。\n</p>\n<p>\n    Microsoft Officeソフトウェアの普及により、Word、Excel、Access、Powerpointの一般的なOfficeソフトウェアはすべてVBAを使用して、これらのソフトウェアのアプリケーションをより効率的にすることができます。たとえば、VBAコードを使用すると、画面を次のようにできます。切り替え;複雑な論理統計を実現します（たとえば、複数のテーブルから、契約番号ごとに生産、保管、販売、在庫を追跡する統計リストを自動的に生成します）など。 <br/>\n</p>\n<p>\n    <strong>VBAをマスターすると、次の役割を果たすことができます：</strong>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            ユーザー操作を標準化し、ユーザーの行動を制御します；\n        </p>\n    </li>\n    <li>\n        <p>\n            ユーザーが操作するのに便利な人間化された操作インターフェース。\n        </p>\n    </li>\n    <li>\n        <p>\n            VBAコードを実行することにより、手動操作の複数のステップを迅速に実現できます。\n        </p>\n    </li>\n    <li>\n        <p>\n            VBが達成できないいくつかの機能を実現する。\n        </p>\n    </li>\n    <li>\n        <p>\n            VBAを使用してEXCELログインシステムを作成します。\n        </p>\n    </li>\n    <li>\n        <p>\n            VBAを使用して、Excelで強力な自動化プログラムを簡単に開発できます。\n        </p>\n    </li>\n</ol>');
INSERT INTO `think_article_category` VALUES (7, 'ruby专题', 'ruby', '', 1, 0, 1, 0, 'Ruby、Ruby on Rails、Rubyインストール、Ruby言語', 'シンプルで高速なオブジェクト指向（オブジェクト指向プログラミング）スクリプト言語であるRubyは、1990年代に日本のまつもとゆきひろによって開発され、GPL契約とRubyライセンスに準拠しています。 そのインスピレーションと機能は、Perl、Smalltalk、Eiffel、Ada、およびLisp言語から来ています。', '/uploads/images/20211017\\435cc280f4b2c53d80f4ff8cadb071c9.png', '<h1>\n    ruby\n</h1>\n<p>\n    Rubyは純粋なオブジェクト指向プログラミング言語です。 1993年に日本のまつもとゆきひろ/まつもとゆきひろによって設立されました。\n</p>\n<p>\n    <strong>Rubyはプログラマーの親友です。</strong><br/>\n</p>\n<p>\n    Rubyの機能は、Smalltalk、Perl、Pythonに似ています。 Perl、Python、およびSmalltalkはスクリプト言語です。 Smalltalkは真のオブジェクト指向言語です。 Rubyは、Smalltalkと同様に、完璧なオブジェクト指向言語です。 Rubyの構文を使用する方が、Smalltalkの構文を使用するよりもはるかに簡単です。<br/>\n</p>\n<p>\n    <strong>Rubyの機能</strong>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            Rubyはオープンソースであり、Webで無料で入手できますが、ライセンスが必要です。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは、汎用のインタプリタプログラミング言語です。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは真のオブジェクト指向プログラミング言語です。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは、PythonやPerlに似たサーバーサイドスクリプト言語です。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyを使用して、Common Gateway Interface（CGI）スクリプトを作成できます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyはハイパーテキストマークアップ言語（HTML）に埋め込むことができます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyの構文は単純なので、新しい開発者はRubyをすばやく簡単に学ぶことができます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyの構文は、C ++やPerlなどの多くのプログラミング言語と似ています。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは拡張可能であり、Rubyで記述された大規模なプログラムは保守が容易です。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは、インターネットおよびイントラネットアプリケーションの開発に使用できます。\n        </p>\n    </li>\n    <li>\n        <p>\n            RubyはWindowsおよびPOSIX環境にインストールできます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは、Tcl / Tk、GTK、OpenGLなどの多くのGUIツールをサポートしています。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyは、DB2、MySQL、Oracle、およびSybaseに簡単に接続できます。\n        </p>\n    </li>\n    <li>\n        <p>\n            Rubyには豊富な組み込み関数があり、Rubyスクリプトで直接使用できます。\n        </p>\n    </li>\n</ol>');
INSERT INTO `think_article_category` VALUES (8, 'PowerShell', 'power shell', '', 1, 0, 2, 0, 'PowerShell', 'Windows PowerShellは、コマンドラインユーザーとスクリプト作成者が.NETFrameworkの強力な機能を利用できるようにするコマンドラインシェルおよびスクリプト環境です。 これは、WindowsコマンドプロンプトとWindows ScriptHost環境で得た知識とスクリプトをさらに拡張するための多くの非常に便利な新しい概念を紹介します。', '/uploads/images/20211017\\1aa5338976e4790fa74997003581c639.png', '<h1>\n    PowerShell\n</h1>\n<p>\n    Windows PowerShellは、コマンドラインユーザーとスクリプト作成者が.NETFrameworkの強力な機能を利用できるようにするコマンドラインシェルおよびスクリプト環境です。<br/>\n</p>\n<p>\n    これは、WindowsコマンドプロンプトとWindows ScriptHost環境で得た知識とスクリプトをさらに拡張するための多くの非常に便利な新しい概念を紹介します。<br/>\n</p>\n<p>\n   Windows PowerShell v3は、Microsoft Hyper-V3.0およびWindowsServer2012とともにリリースされます。 PowerShell v3は、Windowsタスク自動化フレームワークであり、コマンドラインシェルと.NETフレームワークに組み込まれたプログラミング言語で構成されています。<br/>\n</p>\n<p>\n    PowerShell v3は、新しいコマンドレットを使用して、管理者がシステムプロセスを深く掘り下げ、実行可能ファイルまたはスクリプトにすることができるようにします。 コマンドレットは軽量のコマンドであり、WindowsPowerShellランタイムは自動化されたスクリプト環境でコマンドレットを呼び出します。<br/>\n</p>\n<p>\n    コマンドレットには、現在のディレクトリを表示するためのGet-Location、ファイルのコンテンツにアクセスするためのGet-Content、および実行中のプロセスを終了するためのStop-Processが含まれています。<br/>\n</p>\n<p>\n    PowerShell v3には、Windows Server8のWindowsManagement Framework3.0がロードされています。 PowerShellランタイムは、他のアプリケーションに組み込むこともできます。\n</p>');
INSERT INTO `think_article_category` VALUES (9, 'linux shell', 'linux shell', '', 1, 0, 1, 0, 'linux shell', 'シェルはシステムのユーザーインターフェイスであり、ユーザーがカーネルと対話するためのインターフェイスを提供します。 ユーザーが入力したコマンドを受信し、実行のためにカーネルに送信します。 実際、シェルはコマンドインタープリターであり、ユーザーが入力したコマンドを解釈してカーネルに送信します。', '/uploads/images/20211017\\b4bcedc5a836a9e354b8b2ac1e2f49ca.png', '<h1>\n    linux shell\n</h1>\n<p>\n    Shellは、システムのユーザーインターフェイスであり、ユーザーがカーネルと対話するためのインターフェイスを提供します。 ユーザーが入力したコマンドを受信し、実行のためにカーネルに送信します。<br/>\n</p>\n<p>\n    実際、Shellはコマンドインタープリターであり、ユーザーが入力したコマンドを解釈してカーネルに送信します。 それだけでなく、Shellにはコマンドを編集するための独自のプログラミング言語があり、ユーザーはShellコマンドで構成されるプログラムを作成できます。 Shellプログラミング言語には、通常のプログラミング言語の多くの特徴があります。たとえば、ループ構造や分岐制御構造などがあります。このプログラミング言語で記述されたShellプログラムは、他のアプリケーションと同じ効果があります。<br/>\n</p>\n<p>\n    Linuxは、Microsoft Windows-Xウィンドウのグラフィカルユーザーインターフェイス（GUI）のような視覚的なコマンド入力インターフェイスを提供します。 それは多くのデスクトップ環境システムを提供し、その操作はウィンドウズのようであり、ウィンドウズ、アイコン、メニューがあり、すべての管理はマウスによって制御されます。 GNOME。<br/>\n</p>\n<p>\n    各Linuxシステムユーザーは、独自の特別なシェルのニーズを満たすために、独自のユーザーインターフェイスまたはシェルを持つことができます。\n</p>\n<p>\n    Linux自体と同様に、Shellにはさまざまなバージョンがあります。 Shellには主に次のバージョンがあります。\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            Bourne Shell：ベル研究所によって開発されました。\n        </p>\n    </li>\n    <li>\n        <p>\n            BASH：これはGNUのBourne Again Shellであり、GNUオペレーティングシステムのデフォルトのShellです。\n        </p>\n    </li>\n    <li>\n        <p>\n            Korn Shell：これはBourne SHellの開発であり、ほとんどのコンテンツでBourne Shellと互換性があります。\n        </p>\n    </li>\n    <li>\n        <p>\n            C Shell：SUN社ShellのBSDバージョンです。\n        </p>\n    </li>\n    <li>\n        <p>\n            Z Shell：The last shell you’ll ever need! Zは最後の文字であり、究極のShellです。 独自の機能を追加しながら、bashとkshの重要な機能を統合します。\n        </p>\n    </li>\n</ol>');
INSERT INTO `think_article_category` VALUES (10, 'Lua', 'Lua', '', 1, 0, 1, 0, 'Lua', 'Luaはコンパクトなスクリプト言語です。LuaスクリプトはC / C ++コードで簡単に呼び出すことができ、C / C ++関数を順番に呼び出すことができるため、Luaはアプリケーションで広く使用されています。 拡張スクリプトとしてだけでなく、XML、ini、およびその他のファイル形式の代わりに共通の構成ファイルとしても使用でき、理解と保守が容易です。', '/uploads/images/20211017\\a984da60b6aec21bf7d948340cb10fd4.png', '<h1>\n    Lua\n</h1>\n<p>\n    Luaは小さなスクリプト言語です。 これは、ブラジルのリオデジャネイロのポンティフィカルカトリック大学の研究グループであり、ロベルトイエルサリムシー、ヴァルデマールセレス、ルイスエンリケデフィゲイレドで構成され、1993年に開発されました。 その設計目的は、アプリケーションに柔軟な拡張およびカスタマイズ機能を提供するために、アプリケーションに組み込むことです。 Luaは標準Cで記述されており、ほとんどすべてのオペレーティングシステムとプラットフォームでコンパイルして実行できます。 Luaは、その位置によって決定される強力なライブラリを提供していません。 したがって、Luaは独立したアプリケーションを開発するための言語としては適していません。 Luaには、特定のプラットフォームでジャストインタイムコンパイルを提供する同時JITプロジェクトがあります。<br/>\n</p>\n<p>\n    LuaスクリプトはC / C ++コードで簡単に呼び出すことができ、逆にC / C ++関数を呼び出すこともできるため、Luaはアプリケーションで広く使用されています。 拡張スクリプトとしてだけでなく、XML、ini、およびその他のファイル形式の代わりに共通の構成ファイルとしても使用でき、理解と保守が容易です。 Luaは標準Cで記述されており、コードは簡潔で美しく、ほとんどすべてのオペレーティングシステムとプラットフォームでコンパイルして実行できます。 完全なLuaインタープリターは200k以下です。現在のすべてのスクリプトエンジンの中で、Luaが最速です。 これらすべてが、Luaが埋め込みスクリプトとして最良の選択であることを決定します。\n</p>\n<p>\n    Luaの目標は、他の言語に簡単に埋め込むことができる言語になることです。 ほとんどのプログラマーは、これを行うと考えています。<br/>\n</p>\n<p>\n    多くのアプリケーションやゲームは、組み込みスクリプト言語としてLUAを使用して、構成可能性とスケーラビリティを実現しています。 これには、World of Warcraft、Baldur\'s Gate、Angry Birds、QQ Three Kingdoms、VOCALOID3、Sun God Three Kingdoms、Yu-Gi-Ohygocoreなどが含まれます。\n</p>');
INSERT INTO `think_article_category` VALUES (11, 'Golang', 'Golang', '', 1, 0, 1, 0, 'Golang', 'Goは、Googleによって開発された、コンパイルされ、並列化され、ガベージコレクションされたプログラミング言語です。 Go言語は、Infernoオペレーティングシステムに基づいて開発されています。 Go言語は2009年11月にオープンソースプロジェクトとして正式に発表され、LinuxおよびMac OS Xプラットフォームに実装され、Windowsでの実装が後で追加されました。', '/uploads/images/20211017\\fd729f7a6b5b67cc619973cb721b277d.jpg', '<h1>\n    Golang\n</h1>\n<p>\n    Go言語は、2009年にGoogleがリリースした2番目のオープンソースプログラミング言語です。 Go言語は、マルチプロセッサシステムアプリケーションのプログラミング用に最適化されています。Goでコンパイルされたプログラムは、CまたはC ++コードの速度に匹敵し、より安全で、並列プロセスをサポートします。 <br/>\n</p>\n<p>\n    Go言語は、Googleが立ち上げたまったく新しいプログラミング言語であり、アプリケーションのパフォーマンスを損なうことなく、コードの複雑さを軽減できます。 GoogleのチーフソフトウェアエンジニアであるRobPikeは、次のように述べています。過去10年間のソフトウェア開発の苛立たしい困難のため、Goを開発しました。 Goは、2009年にGoogleがリリースした2番目のプログラミング言語です。<br/>\n</p>\n<p>\n    <strong>特色</strong>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            シンプル、高速、安全\n        </p>\n    </li>\n    <li>\n        <p>\n            並列、興味深い、オープンソース\n        </p>\n    </li>\n    <li>\n        <p>\n            メモリ管理、アレイセキュリティ、高速コンパイル\n        </p>\n    </li>\n</ol>\n<p>\n    Goの目標は、既存のプログラミング言語のライブラリなどへの依存関係の管理を改善することです。これらのソフトウェア要素は、アプリケーションによって繰り返し呼び出されます。 並列プログラミングモデルのため、この言語はマルチプロセッサタスクを解決するようにも設計されています。<br/>\n</p>\n<p>\n    Googleは2007年頃にGoの開発を開始し、2008年に正社員のグループに投資しました。 Googleは当初、ネットワークサーバー、ストレージシステム、データベースで使用できるシステムプログラミング言語としてこの言語を設計しました。 しかしグーグルは、この言語が他の分野でも使用されることが期待されていると信じています。\n</p>');
INSERT INTO `think_article_category` VALUES (12, 'Erlang', 'Erlang', '', 1, 0, 1, 0, 'Erlang', 'Erlangは、汎用の同時実行指向プログラミング言語であり、スウェーデンの通信機器メーカーであるEricssonの管轄下にあるCS-Labによって開発されました。目的は、大規模な同時アクティビティに対応できるプログラミング言語と操作環境を作成することです。 ', '/uploads/images/20211017\\a798150587b162bc21d2e935a47f18ac.png', '<h1>\n    Erlang\n</h1>\n<p>\n    Erlangプログラミング言語の本来の目的は、大規模な通信スイッチング機器用のソフトウェアを開発することでした。これは、大規模な並列処理環境に適した信頼性の高いプログラミング言語です。 マルチコアプロセッサ技術の人気の高まり、およびインターネットやクラウドコンピューティングなどの技術の開発に伴い、言語の適用範囲も徐々に拡大しています。\n</p>\n<p>\n    Erlangは、並行ランタイム環境向けの汎用プログラミング言語です。 この言語は1986年にエリクソンによって開発されました。 設計当初、Erlangの開発者は、大規模な通信スイッチング機器の開発に適したプログラミング言語を見つけることに重点を置き、次の目標を達成しました。:<br/>\n</p>\n<p>\n    <strong>大規模な並行処理と分散コンピューティング機能</strong><br/>\n</p>\n<p>\n    多数の同時サービスを同時に処理する（たとえば、数百万の電話を同時に処理する）、ビジネス処理をタイムリーかつ特定の短時間で完了する必要があります。大規模な分散処理システムに適用し、継続的に対話する必要があります。ハードウェア付き。<br/>\n</p>\n<p>\n    <strong>高信頼性で高品質の通信製品の開発に使用されます</strong><br/>\n</p>\n<p>\n    数年連続の中断のない操作;ソフトウェアシステムで実行されるメンテナンス操作（構成の変更、アップグレードなど）は、ソフトウェア自体の操作と比較されません;ハードウェア障害およびソフトウェアエラーの場合のフォールトトレランス、厳密に制限障害とエラーの範囲。<br/>\n</p>\n<p>\n    <strong>複雑なプロジェクトに適しています</strong><br/>\n</p>\n<p>\n    超大規模なソフトウェア開発プロジェクト（たとえば、数百万行のコード）に使用されます。実装されたソフトウェアは複雑な機能を完了することができ、さまざまな機能間で多くの相互作用があります。<br/>\n</p>\n<p>\n    その後、Erlangはエリクソン内の多くの通信機器開発プロジェクトで使用され、徐々に改善されました。Erlangは1988年の終わりにオープンソース言語になりました（エリクソンにとってのオープンソースの直接的な利点は、Erlang言語自体の保守と開発です。 、および関連する教育とトレーニングへの投資は、もはやエリクソンだけが負担するものではありません。オープンソースコミュニティのケアの下で、Erlangはより良く開発され、エリクソンは言語の結果を引き続き楽しむことができます）、しかしそれは広くはありません知られている;近年、インターネットベースのeコマース、インスタントメッセージング、クラウドコンピューティングや大規模なオンラインゲームなどのアプリケーションの開発、およびマルチコアプロセッサの段階的な台頭により、Erlangの利点は大規模な同時処理能力と高い信頼性はますます多くの人々に評価されており、その適用範囲は徐々に拡大しています。\n</p>');
INSERT INTO `think_article_category` VALUES (13, '网络编程', 'ネットワークプログラミング', 'network_programming', 0, 1, 1, 2, 'ネットワークプログラミング、ASPプログラミング、JavaScript、CSS / HTML、AJAX関連', 'ネットワークプログラミング、ASPプログラミング、JavaScript、CSS / HTML、AJAX関連、asp、php、asp.net。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (14, 'JavaScript', 'JavaScript', '', 13, 0, 1, 0, 'javascriptチュートリアル、jsの基本、jsスキル、jquery、json、ajax', 'JavaScriptは、比較的セキュリティの高いオブジェクトとイベントによって駆動されるクライアント側のスクリプト言語です。 同時に、クライアント側のWeb開発で広く使用されているスクリプト言語でもあり、ユーザーのさまざまな操作への応答など、HTMLページに動的な機能を追加するためによく使用されます。', '/uploads/images/20211018\\fb9d6131dd25bc94cb81cd7e32bdd20e.png', '<h1>JavaScript</h1><p>JavaScriptは、Webアプリケーション開発で広く使用されているネットワークに属するスクリプト言語であり、Webページにさまざまな動的機能を追加し、よりスムーズで美しいブラウジング効果をユーザーに提供するためによく使用されます。 通常、JavaScriptスクリプトは、HTMLに埋め込むことで機能を実現します。</p><ul class=\" list-paddingleft-2\"><li><p>インタプリタされたスクリプト言語です（コードはプリコンパイルされていません）。</p></li><li><p>主に、HTML（標準の一般的なマークアップ言語のアプリケーション）ページにインタラクティブな動作を追加するために使用されます。</p></li><li><p>HTMLページを直接埋め込むことができますが、別個のjsファイルとして書き込むと、構造と動作を分離するのに役立ちます。</p></li><li><p>クロスプラットフォーム機能。ほとんどのブラウザーのサポートにより、複数のプラットフォーム（Windows、Linux、Mac、Android、iOSなど）で実行できます。</p></li></ul><p>Javascriptスクリプト言語には、他の言語と同様に、独自の基本的なデータ型、式、算術演算子、およびプログラムの基本的なプログラムフレームワークがあります。 Javascriptは、データとテキストを処理するための4つの基本的なデータ型と2つの特別なデータ型を提供します。 変数は情報を格納する場所を提供しますが、式はより複雑な情報処理を完了することができます。</p>');
INSERT INTO `think_article_category` VALUES (15, 'ASP.NET', 'ASP.NET', '', 13, 0, 1, 0, 'asp.netチュートリアル、asp.net情報', 'ASP.NETは、.NETFrameWorkの一部です。MicrosoftCorporationのテクノロジです。Webページに埋め込まれたスクリプトをインターネットサーバーで実行できるようにするサーバー側スクリプトテクノロジです。Webサーバーで使用できます。ドキュメントがHTTP経由で要求されたとき。動的に作成します。', '/uploads/images/20211018\\8582a85c854c8fdd4fa7b9106569cd88.png', '<h1>\n    ASP.NET\n</h1>\n<p>\n    ASP.NETは、Microsoftによって.NET Frameworkフレームワークで提供されます。Webアプリケーションを開発するためのクラスライブラリは、System.Web.dllファイルにカプセル化され、System.Web名前名を明らかにし、ASP.NETWebページの処理と拡張を提供します。また、HTTPチャネルのアプリケーションと通信の処理、およびWebサービスのインフラストラクチャ。 ASP.NETはASPテクノロジの後継ですが、その開発はASPテクノロジよりもはるかに強力です。\n</p>\n<p>\n    ASP.NETは、.NET FrameworkがインストールされたIISサーバーで実行できます。Microsoft以外のプラットフォームで実行する場合は、Monoプラットフォーム[1]を使用する必要があります。ASP.NETはバージョン2.0で完成し、オンになっています。 .NET Framework 3.5 ASP.NET AJAX、ASP.NET MVC Framework、ASP.NET Dynamic Data、MicrosoftSilverlightサーバーコントロールなどの多くの機能が追加されています。\n</p>\n<p>\n    多くの人がASP.NETをプログラミング言語と見なしていますが、実際には.NET Frameworkによって提供される開発プラットフォームであり、プログラミング言語ではありません。\n</p>\n<p>\n    ASP.NETを.NETコンポーネントと考えることもできます。C＃などの.NET言語は、このコンポーネントを参照してWebページまたはWebサービスを作成できます。<br/>\n</p>');
INSERT INTO `think_article_category` VALUES (16, 'PHP编程', 'PHP', '', 13, 0, 1, 0, 'phpの基本、phpチュートリアル、phpダウンロード、phpソースコード', 'PHP（PHPの略語：Hypertext Preprocessor、日本語名：「HypertextPreprocessor」）は、汎用のオープンソーススクリプト言語です。 この文法は、C言語、Java、Perlの特性を吸収し、入力しきい値が低く、習得が容易で、広く使用されています。主にWeb開発の分野に適しています。 PHPのファイル拡張子はphpです。', '/uploads/images/20211018\\885d6b4e0de1eaa4370d9a0ea8895f28.png', '<h1>\n    PHP\n</h1>\n<p>\n    PHP（外国名：PHP：ハイパーテキストプリプロセッサー、日本語名：「ハイパーテキストプリプロセッサー」）は、ユニバーサルなオープンソースのスクリプト言語です。 この文法は、C言語、Java、Perlの特性を吸収し、学習に役立ち、広く使用されており、主にWeb開発の分野に適しています。 PHPの独自の構文は、C、Java、Perl、およびPHP独自の構文を組み合わせたものです。 CGIやPerlよりも高速に動的Webページを実行できます。 PHPは、他のプログラミング言語と比較して、プログラムをHTML（標準のユニバーサルマークアップ言語のアプリケーション）ドキュメントに埋め込んで実行します。実行効率は、HTMLマークアップを完全に生成するCGIよりもはるかに高く、コンパイルされたコードも実行できます。コンパイルにより、暗号化と最適化されたコード実行が実現され、コードの実行が高速化されます。<br/>\n</p>\n<p>\n    <strong>PHPの特性には：</strong><br/>\n</p>\n<ol class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            PHPの独自の構文は、C、Java、Perl、およびPHP独自の革新的な構文を組み合わせたものです。\n        </p>\n    </li>\n    <li>\n        <p>\n            PHPはCGIやPerlよりも高速に動的Webページを実行できます-動的ページに関しては、他のプログラミング言語と比較して、PHPは実行のためにプログラムをHTMLドキュメントに埋め込み、実行効率はhtmLタグを完全に生成するCGIよりもはるかに高くなります。 ; PHPには非常に強力な機能があり、すべてのCGI機能はPHPで実現できます。\n        </p>\n    </li>\n    <li>\n        <p>\n            PHPはほとんどの人気のあるデータベースとオペレーティングシステムに対応しています。\n        </p>\n    </li>\n    <li>\n        <p>\n            最も重要なことは、PHPがC、C ++を使用してプログラムを拡張できることです。\n        </p>\n    </li>\n</ol>\n<p>\n    PHPは無料で、広く使用されています。 同時に、Microsoft ASPのような競合他社にとって、PHPは間違いなくもう1つの非常に効率的なオプションです。\n</p>');
INSERT INTO `think_article_category` VALUES (17, '正则表达式', '正規表現', '', 13, 0, 1, 0, '正規表現構文、Java正規表現、正規表現、正規表現数字', '正規表現は多くのプログラム設計言語が正規表現を使った文字列操作をサポートしています。ここでは正規表現に関する知識を整理しました。', '/uploads/images/20211018\\d904fd7b338475e0f3ce8c7b50498a63.png', '<h1>\n    正規表現\n</h1>\n<p>\n    <strong>コンセプト</strong>\n</p>\n<p>\n    正規表現は、文字列（通常の文字（たとえば、aとzの間の文字）と特殊文字（「メタ文字」と呼ばれる）を含む）を操作する一種の論理式であり、特定の定義済み文字とその組み合わせを使用します。これらの特定の文字のうち、「ルール文字列」を形成します。この「ルール文字列」は、文字列の一種のフィルタリングロジックを表すために使用されます。 正規表現は、テキストを検索するときに一致する1つ以上の文字列を記述するテキストパターンです。\n</p>\n<p>\n    <strong>正規表現-構文</strong><br/>\n</p>\n<p>\n    正規表現は、文字列照合のパターンを記述します。これを使用して、文字列に特定の部分文字列が含まれているかどうかを確認したり、一致した部分文字列を置き換えたり、文字列から特定の条件を満たす部分文字列を抽出したりできます。<br/>\n</p>\n<p>\n    例えば：<br/>\n</p>\n<p>\n    scriptjpgoo + dは、scriptjpgoo、scriptjpgoood、scriptjpgooooodなどと一致します。+記号は、前の文字が少なくとも1回（1回以上）出現する必要があることを意味します。 &nbsp;<br/>scriptjpgoo * dは、scriptjpgood、scriptjpgoood、scriptjpgoooooodなどと一致します。*記号は、文字が表示されないこと、または1回または複数回（0回、1回、または複数回）表示されることを表します。 &nbsp;<br/>colou？rは色または色と一致することができ、疑問符は前の文字が1回（0または1回）しか表示できないことを意味します。 &nbsp;<br/>\n &nbsp;正規表現の作成方法は、数式の作成方法と同じです。 つまり、さまざまなメタ文字と演算子を使用して、小さな式を組み合わせて大きな式を作成できます。 正規表現のコンポーネントは、単一の文字、文字のセット、文字の範囲、文字間の選択、またはこれらすべてのコンポーネントの任意の組み合わせにすることができます。<br/>\n</p>\n<p>\n    正規表現は、通常の文字（aからzまでの文字など）と特殊文字（メタ文字と呼ばれる）で構成されるテキストパターンです。 パターンは、テキストを検索するときに一致する1つ以上の文字列を記述します。 正規表現は、特定の文字パターンを検索された文字列と照合するためのテンプレートとして使用されます。\n</p>');
INSERT INTO `think_article_category` VALUES (18, 'AJAX相关', 'AJAX', '', 13, 0, 1, 0, 'ajax、jquery、JSON、extjs、jQueryMobile', 'Ajaxの中核はJavaScriptオブジェクトXmlHttpRequestです。 このオブジェクトはInternetExplorer 5で最初に導入されたもので、非同期要求をサポートするテクノロジです。 つまり、XmlHttpRequestを使用すると、JavaScriptを使用してサーバーにリクエストを送信し、ユーザーをブロックすることなくレスポンスを処理できます。', '/uploads/images/20211018\\0835ab88759f1c13df2551b08592d3ad.png', '<h1>AJAX</h1><p>Ajaxは「AsynchronousJavascriptAnd XML」（非同期JavaScriptおよびXML）の略で、インタラクティブなWebアプリケーションを作成するためのWeb開発テクノロジーを指します。<br/></p><p>Ajax =非同期JavaScriptおよびXML（標準のユニバーサルマークアップ言語のサブセット）。<br/></p><p>Ajaxは、高速で動的なWebページを作成するために使用されるテクノロジーです。<br/></p><p>Ajaxは、Webページ全体をリロードせずにWebページの一部を更新できるテクノロジーです。<br/></p><p>少量のデータをバックグラウンドでサーバーと交換することにより、AjaxはWebページを非同期的に更新させることができます。 これは、Webページ全体をリロードせずにWebページの特定の部分を更新できることを意味します。 <br/>コンテンツを更新する必要がある場合、従来のWebページ（Ajaxを使用しない）はWebページ全体をリロードする必要があります。</p><p><strong>注意：</strong>Ajaxは新しいプログラミング言語ではありませんが、より優れた、より高速で、よりインタラクティブなWebアプリケーションを作成するために使用されるテクノロジーです。<br/></p>');
INSERT INTO `think_article_category` VALUES (19, 'ASP编程', 'ASP', '', 13, 0, 1, 0, 'asp基礎、asp技巧、asp関数', 'ASPはダイナミックサーバページの英語略語です。[1]マイクロソフトが開発したCGIスクリプトの代替プログラムの一種であり、データベースや他のプログラムと対話できる、簡単で便利なプログラミングツールである。ASPのウェブページのファイルのフォーマットは.aspです。現在は様々な動画サイトで使われています。', '/uploads/images/20211018\\e92f146dcb28f9d24f7a51218fa39e02.png', '<h1>\n    ASP\n</h1>\n<p>\n    ASPはダイナミックサーバページ（Active Server Page）英語の略語です。[1]マイクロソフトが開発したCGIスクリプトの代替プログラムの一種であり、データベースや他のプログラムと対話できる、簡単で便利なプログラミングツールである。ASPのウェブページのファイルのフォーマットは.aspです。現在は様々な動画サイトで使われています。<br/>\n</p>\n<p>\n    <strong>ASP 是什么？</strong><br/>\n</p>\n<p>\n    ASP代表Active Server Pages（ダイナミックサーバページ）<br/>ASPはマイクロソフトの技術です。<br/>ASPはIISで実行されるプログラムです<br/>IIS代表Internet Information Services（Internet情報サービス）<br/>IISはWindows 2000の無料コンポーネントです。<br/>IISはWindows NT 4.0 Option Packの構成部分でもある。<br/>Microsoftサイトからダウンロードできます<br/>PWSの体積はより小さいです。ただし、IISの完全機能があります。<br/>PWSはあなたのWindows 95/98 CDの中で見つけることができます。<br/>\n</p>');
INSERT INTO `think_article_category` VALUES (20, 'JSP编程', 'JSP', '', 13, 0, 1, 0, 'JSP、PHP、ASP、C38085;、JAVA、プログラミング技術', 'JSPのフルネームはJavaServer Pagesで、中国語の名前はjava server pageです。JSPはWebページロジックとWebページデザインの表示を分離し、再利用可能なコンポーネントベースのデザインをサポートし、Webベースのアプリケーションの開発を迅速にします。簡単。 JSP（JavaServer Pages）は、プレゼンテーションロジックをサーブレットから分離することを主な目的とする動的ページテクノロジです。', '/uploads/images/20211018\\0a17f37b678c1560e064d2615ad1089f.png', '<h1>\n    JSP\n</h1>\n<p>\n    JSP（Java Server Pages）は、Sun Microsystemsによって開始され、多くの企業が参加している動的なWebページテクノロジ標準です。 JSPテクノロジは、スクリプト言語としてJAVA言語を使用します。JSPWebページは、サーバー側のJAVAライブラリユニット全体がHTTPアプリケーションにサービスを提供するためのインターフェイスを提供します。<br/>\n</p>\n<p>\n    Javaプログラムフラグメント（スクリプトレット）とJSPタグ（タグ）を従来のWebページのHTMLファイル（*.htm、*.html）に追加すると、JSP Webページ（*.jsp）が構成されます。 Webサーバーは、JSP Webページへのアクセス要求を検出すると、最初にその中のプログラムフラグメントを実行し、次に実行結果をHTML形式でクライアントに返します。 プログラムフラグメントは、動的なWebサイトを構築するために必要な機能である、データベースの操作、Webページのリダイレクト、電子メールの送信などを行うことができます。 すべてのプログラム操作はサーバー側で実行され、結果のみがネットワーク上のクライアントに送信されます。クライアントのブラウザーの要件は最小限であり、プラグイン、ActiveX、Javaアプレット、さらにはフレームなしで実装できます。<br/>\n</p>\n<p>\n    <strong>JSPの利点：<br/></strong>\n</p>\n<p>\n    ・ユーザーインターフェースの更新は実際にはWebサーバーで行われているため、更新が非常に速いように感じます。 <br/>・すべてのアプリケーションはサーバーベースであるため、常に最新バージョンを維持できます。 <br/>・クライアントインターフェイスはそれほど面倒ではなく、さまざまなアプリケーションの展開、保守、変更が簡単です。\n</p>');
INSERT INTO `think_article_category` VALUES (21, 'CSS/HTML', 'CSS/HTML', '', 13, 0, 1, 0, 'CSS、HTML、CSSの紹介、CSSチュートリアル、HTMLチュートリアル', 'カスケードスタイルシートは、HTML（標準のユニバーサルマークアップ言語のアプリケーション）またはXML（標準のユニバーサルマークアップ言語のサブセット）およびその他のファイルスタイルを表現するために使用されるコンピューター言語です。CSSの最新バージョンはCSS3であり、実際にAスタイルを実行できます。 Webページのパフォーマンスをコンテンツから分離する設計言語。', '/uploads/images/20211018\\75ad297c9a83ea290618fed74454ad4d.png', '<h1>CSS/HTML</h1><p>CSS (Cascading Style Sheets) は、HTML要素タグのスタイルをレンダリングするために使用されます。</p><p><strong>CSSの使い方</strong><br/></p><p>CSSはHTML4で使用され、HTML要素のレンダリングを改善するために導入されました。<br/>CSSは次の方法でHTMLに追加できます:<br/>インラインスタイル-HTML要素で「style」属性を使用します<br/>内部スタイルシート-HTMLドキュメントのhead領域にあるstyle要素を使用してCSSを含めますS<br/>外部参照-外部CSSファイルを使用します<br/>最良の方法は、CSSファイルを外部から参照することです。</p><p><strong>htmlとは</strong><br/></p><p>HTML（HyperText MarkUp Language）ハイパーテキストマークアップ言語は、タグを使用してドキュメントの構造と表示を記述する言語であり、ブラウザによって解析され、結果がWebページに表示されます。素人の用語では、これは文字列です。サーバーから送信されるブラウザでは、HTMLは、ブラウザが解析できるルールを記述するために使用されます。これはWebページの基礎です。表示されるすべてのWebページはHTMLから切り離せないため、HTMLの学習が基礎の基礎です。</p><p>HTML言語は、サーバー側でコンパイルする必要がなく、ブラウザーによって直接解釈および実行されるマークアップ言語です<br/>HTMLファイルは、HTML自体のすべての要素を含むテキストファイルです<br/>HTMLファイルでは、ファイル名のサフィックスとしてhtmlまたはhtmを使用する必要があります<br/>HTMLでは大文字と小文字が区別されないため、HTMLとhtmlは同じです</p>');
INSERT INTO `think_article_category` VALUES (22, 'Flex', 'Flex', '', 13, 0, 1, 0, 'Flex、Flex開発、Flexはじめに、Adobe', 'Flexは、RIAの開発と展開をサポートする一連のテクノロジーの組み合わせをカバーする独自のMacromediaFlashプラットフォームに基づくAdobeFlexを指します。 このコラムでは、開発環境の構築方法、デバッグ方法、単純なFlexプロジェクトの構築と展開の方法など、Flex開発の基本的な知識を紹介します。 学習することで、将来Flexを深く学ぶための良い基盤を築くことができます。', '/uploads/images/20211018\\56702ad9c334226843408ffb9e02f211.png', '<h1>\n    Flex\n</h1>\n<p>\n    <strong>Flexレイアウトとは何ですか？</strong><br/>\n</p>\n<p>\n    FlexはFlexible Boxの略語であり、「弾性配置」を意味し、箱状モデルのために最大の柔軟性を提供する。Flexレイアウトの要素をFlex容器（flex container）と呼び、略して「容器」と呼ぶ。そのすべてのサブ要素は自動的に容器のメンバーになります。Flexプロジェクトと呼ばれます。略称は「プロジェクト」です。\n</p>\n<p>\n    Flexは、Adobe Flash PlayerとAdobe AIRを利用して、表現力のあるWebアプリケーションを構築するために、高効率で無料のオープンソースフレームです。ブラウザ、デスクトップ、オペレーティングシステムを実現することができます。Flexフレームを使ってFlexアプリケーションを構築するしかないが、Adobe Flash Buider™（以前はAdobe Flex Buiderと呼ばれていました。™）ソフトウェアは、インテリジェントコード、インタラクティブプログラミング、ビジュアルデザインユーザーインターフェースレイアウトなどの機能によって開発を加速することができます。\n</p>\n<p>\n    Flexを使って作成したRIAは、Adobe Flash Playerプラグインを備えたブラウザで実行したり、オペレーティングシステムにまたがるAdobe AIRで実行したりして、すべての主流ブラウザ、オペレーティングシステムにまたがって実行できます。AdobeAIRを利用することで、Flexアプリケーションはローカルデータとシステムリソースにアクセスすることができます。<br/>\n</p>\n<p>\n    Flexはjavaまたは.netなどの非Flashルートを通じて.mxmlファイルを解釈し，対応する.swfファイルを生成する。Flexのcomponentはflashのcomponentと似ていますが、改善されました。Macromediaは既にADOBEに買収されました。Adobeは2013年1月15日にFlexをApacheに寄付し、Apache Flex 4.8を発表しました。\n</p>');
INSERT INTO `think_article_category` VALUES (23, '脚本加解密', 'スクリプトの暗号化と復号化', '', 13, 0, 2, 0, '暗号化チュートリアル、暗号化デモンストレーション、復号化の例、暗号化ビデオ、復号化チュートリアル、復号化デモンストレーション、暗号化の例、復号化ビデオ', '多くの場合、スクリプトにはユーザー名、パスワード、その他の重要な情報などの個人情報が含まれます。システムのセキュリティとスクリプトの拡散を確保するために、暗号化方式を使用してこれらの情報を保護します。通常、この場合は、ScriptHouseのスクリプトの暗号化と復号化のみが必要です。', '/uploads/images/20211019\\18841b9f3350c80cb9757b762ba02220.png', '<h1>\n    スクリプトの暗号化と復号化\n</h1>\n<p>\n    <strong>スクリプトの暗号化と復号化ソフトウェアの説明</strong><br/>\n</p>\n<p>\n    データのセキュリティを保護するために、一部のファイルを暗号化または復号化する必要がある場合や、パスワードを忘れる必要がある場合があります。 ダウンロードバーの暗号化および復号化ソフトウェアチャネルは、最新かつ最も完全な暗号化および復号化ソフトウェアのダウンロードをユーザーに提供します。 暗号化および復号化ソフトウェア、暗号化および復号化ソフトウェアのダウンロードセンター、ここから、最も人気のある最も人気のある暗号化および復号化ソフトウェアだけでなく、国内外のいくつかのユニークな暗号化および復号化ソフトウェアもダウンロードできます。\n</p>');
INSERT INTO `think_article_category` VALUES (24, 'web2.0', 'web2.0', '', 13, 0, 2, 0, 'web2.0、html、xhtml、xml', 'Web 2.0はWeb 1.0に対して新しい時代です。ウェブを利用したプラットフォームであり、ユーザー主導によって生成されたコンテンツ・インターネット製品のモデルを指し、従来のウェブサイト従業員主導によって生成されたコンテンツを区別するために、第二世代インターネット、すなわちweb 2.0と定義される新しい時代である。本コラムは主に皆様に関連する教程即ち情報を提供します。', '/uploads/images/20211019\\e10c14506bb8b403e33549e0b1e78551.png', '<h1>\n    web2.0\n</h1>\n<p>\n    Web2.0は、Web1.0に比べて新しい時代です。 Webベースのプラットフォームであるユーザー主導のコンテンツインターネット製品モデルを指します。これは、従来のWebサイトの従業員によって生成されたコンテンツを区別するために、第2世代のインターネットとして定義されています。Web2.0は新しい時代です。\n</p>\n<p>\n    <strong> Web2.0の特徴</strong> <br/>\n</p>\n<p>\n    1。複数人の参加<br/>\n</p>\n<p>\n    Web1.0では、インターネットコンテンツはポータルなどの少数の編集者（またはウェブマスター）によってカスタマイズされます。Web2.0では、誰もがコンテンツの寄稿者です。 <br/>\n</p>\n<p>\n    2、人は魂です<br/>\n</p>\n<p>\n    インターネットの新時代では、情報はすべての人から提供され、各人が集合的にインターネット情報源を形成します。 Web2.0の魂は人間です。 <br/>\n</p>\n<p>\n    3。読み取りおよび書き込み可能なインターネット<br/>\n</p>\n<p>\n    Web1.0では、インターネットは「読み取りインターネット」であり、Web2.0は「書き込み可能で読み取り可能なインターネット」です。誰もが情報フィードに参加していますが、大規模では、少数の人々がほとんどのコンテンツを提供しています。 <br/>\n</p>\n<p>\n    4、Web2.0要素<br/>\n</p>\n<p>\n    Web2.0には、ブログ、ポッドキャスト、ウィキ、P2Pダウンロード、コミュニティ、共有サービスなど、私たちがよく使用するサービスが含まれています。ブログは、ポータルWebサイトの情報独占を打破するため、Web2.0の非常に重要な要素です。将来的には、ブログの位置がより重要になります。 <br/>\n</p>\n<p>\n    5。個人的な意見<br/>\n</p>\n<p>\n    Web2.0は実際にはWeb1.0の情報ソースの拡張であり、多様化およびパーソナライズされています。\n</p>\n<p>\n    複雑なWeb2.0現象を脇に置いて、それを技術開発と社会変化の観点に置くと、Web 2.0は、情報の開発によってもたらされた未来志向で人を志向するイノベーション2.0であると言えます。テクノロジーとインターネット革命。インターネット分野におけるモデルの典型的な現れは、専門家によるWebの織り方から、Webへのすべてのユーザーの参加までの革新と民主化のプロセスに関する鮮やかな解説です。\n</p>');
INSERT INTO `think_article_category` VALUES (25, 'XML/RSS', 'XML/RSS', '', 13, 0, 1, 0, 'XML、DTD、RSS、XHTML、DHTML、XHTML', 'XML技術はe-Learning応用システムの開発に広く応用されています。ほとんどの商用e-LearningプラットフォームはXML標準をサポートしています。いくつかの主要なネットワーク機器メーカー、例えばCISCO、JUNIPERなどのネットワーク機器もXMLに対するサポートを提供しており、今後のXMLベースのネットワーク管理に役立つ。', '/uploads/images/20211019\\96923ca1e04beb5e3bfb189b4eabbb87.png', '<h1>XML / RSS</h1><p><strong> XML </strong></p><p>XMLはExtensibleMarkupLanguageの略です<br/>XMLは、データを送信および保存するように設計されています。 <br/>XMLチュートリアルでは、XMLとは何か、およびXMLとHTMLの違いについて学習します。 <br/>XMLは重要で、簡単に習得できます。</p><p><strong> RSS </strong></p><p>RSSを使用すると、興味があり、仕事に関連するニュースを選択的に閲覧できます。 <br/>RSSを使用することで、必要な情報と不要な情報（販売情報、スパムなど）を分離できます。 <br/>RSSを使用すると、独自のニュースチャンネルを作成して、インターネットに公開できます。</p>');
INSERT INTO `think_article_category` VALUES (26, '网页编辑器', 'ウェブエディタ', '', 13, 0, 2, 0, 'Webページエディター、Dreamweaver、Fireworks、Flash、htmlエディター', 'Webページエディタは初心者がすぐに始められるようにすることができ、古いユーザーはそれを置くことができません。 その「デザイナー」と「コードエディター」の機能は非常に充実しており、組み込みの機能も非常に充実しているため、ユーザーはコードを苦労して覚える必要がないため、「表示されるものが得られるもの」のWebページになります。エディターデバイス。', '', '<p><br/></p>');
INSERT INTO `think_article_category` VALUES (27, '相关技巧', '関連スキル', '', 13, 0, 2, 0, 'プログラミングスキル、開発スキル、メンテナンススキル、SQLスキル', 'プログラマーがコードを書くとき、彼らはしばしばコードの可読性に注意を払わないので、他の人がコードを読むことにもっと時間を費やすことができます。 実際、プログラマーがコードを書くときに多くのスキルを持っている限り。 このコラムでは、主にプログラミング、開発、保守、およびスクリプトに関する関連スキルのチュートリアルを紹介します。', '/uploads/images/20211019\\cb7b17af20262418574054fecb34161b.png', '<h1>\n    関連スキル\n</h1>\n<p>\n    関連スキルこの列は、開発者にプログラミングスキル、開発スキル、メンテナンススキル、およびSQLスキルを提供します。 実際、プログラマーはコードを書くときに多くのスキルを持っています。 この列は、開発者にとって便利なウィンドウを提供します。\n</p>');
INSERT INTO `think_article_category` VALUES (28, '安全相关', '安全関連', '', 13, 0, 2, 0, 'HACK、ハッキング、ハッキングテクニック、ウェブサイトのハッキング、チュートリアルのハッキング', 'このコラムでは、主にITテクノロジーとコンピューターサイエンティストが得意な人々を紹介します。 ハッカーはさまざまなプログラミング言語とさまざまなオペレーティングシステムに精通しており、コンピューターとネットワークの開発とともに成長します', '/uploads/images/20211019\\a9f45bb73825505384239764e4e5aeda.png', '<h1>\n    安全関連\n</h1>\n<p>\n    このコラムでは、主にITテクノロジーとコンピューターサイエンティストが得意な人々を紹介します。 ハッカーはさまざまなプログラミング言語とさまざまなオペレーティングシステムに精通しており、コンピューターとネットワークの開発とともに成長します。\n</p>');
INSERT INTO `think_article_category` VALUES (29, '网页播放器', 'Webプレーヤー', '', 13, 0, 2, 0, 'モバイルプレーヤー、プレーヤー、Webプレーヤー、スクリプトプレーヤー、flshプレーヤー', 'WebミュージックプレーヤーはWebプラグインです。作成されたページを実行すると、システムの組み込みプレーヤーが呼び出され、事前設定されたオーディオファイルやその他のオーディオファイルが再生されます。 このコラムでは、主にWebスクリプトに関連するプレーヤーのチュートリアルを共有し、成熟した安定したプレーヤー共有ケースをすべての人に提供したいと考えています。', '/uploads/images/20211019\\61238e0e4c9aa0e8b2062c8f18f422f9.png', '<h1>Webプレーヤー</h1><p>WebミュージックプレーヤーはWebプラグインです。作成されたページを実行すると、システムの組み込みプレーヤーが呼び出され、事前設定されたオーディオファイルやその他のオーディオファイルが再生されます。 このコラムでは、主にWebスクリプトに関連するプレーヤーのチュートリアルを共有し、成熟した安定したプレーヤー共有ケースをすべての人に提供したいと考えています。</p>');
