INSERT INTO `think_article_category` VALUES (31, '软件编程', 'ソフトウェア', 'software_programming', 0, 1, 1, 3, 'ソフトウェアプログラミング、C＃チュートリアル、vb、Javaプログラミング、C言語', '多くのソフトウェアプログラミング言語があり、現在一般的に使用されているソフトウェアプログラミング言語はjava / Android / iOS / PHP / C＃などです。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (32, 'C#教程', 'C#チュートリアル', '', 31, 0, 1, 0, 'C#チュートリアル、C#プログラミング、C#、C#エントリ、配列、マルチスレッド、正規表現、ネットワークプログラミング、データベースプログラミング、デスクトップアプリケーション', 'C#（C Sharp）は、MicrosoftがNET Framework用にカスタマイズしたプログラミング言語です。C#は、C / C++の強力な機能とVisualBasicの使いやすい機能を備えています。また、C++やC++などのオブジェクト指向のプログラミング言語でもあります。 Java。C#チュートリアル、入門、プログラミング例、配列、オブジェクト指向、マルチスレッド、正規表現などのプログラミング資料を提供します。', '/uploads/images/20211019\\cee82a0c84413f4f4064d2447d810477.png', '<h1>\n    C#チュートリアル\n</h1>\n<p>\n    C#は、CおよびC++から派生した、安全で安定した、シンプルでエレガントなオブジェクト指向プログラミング言語です。 複雑な機能の一部を削除しながら、CおよびC++の強力な機能を継承します。 C#は、VBのシンプルな視覚的操作とC++の高い操作効率を兼ね備えています。強力な操作機能、エレガントな構文スタイル、革新的な言語機能、便利なコンポーネント指向プログラミングサポートにより、.NET開発で推奨される言語になっています。\n</p>\n<p>\n    C#の一般的な重要な機能：<br/>\n</p>\n<ul class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            ブール条件(Boolean Coditions)\n        </p>\n    </li>\n    <li>\n        <p>\n            自動ゴミ回収（Automatic Garbage Collection）\n        </p>\n    </li>\n    <li>\n        <p>\n            標準ライブラリ（Standard Library）\n        </p>\n    </li>\n    <li>\n        <p>\n            コンポーネントバージョン（Asemboly Verssioning）\n        </p>\n    </li>\n    <li>\n        <p>\n            属性(Properties)とイベント(Events)\n        </p>\n    </li>\n    <li>\n        <p>\n            依頼（Delegates）とイベント管理（Events Management）\n        </p>\n    </li>\n    <li>\n        <p>\n            使いやすいパントタイプ（Genercas）\n        </p>\n    </li>\n    <li>\n        <p>\n            インデックス(Indexers)\n        </p>\n    </li>\n    <li>\n        <p>\n            条件コンパイル(Coditional Complation)\n        </p>\n    </li>\n    <li>\n        <p>\n            簡単なマルチスレッド(Multihreading)\n        </p>\n    </li>\n    <li>\n        <p>\n            LINQとLambdaの式\n        </p>\n    </li>\n    <li>\n        <p>\n            統合されたウィンドウ\n        </p>\n    </li>\n</ul>\n<p>\n    C#は、.NETフレームワークに基づいて開発されています。 .NET FrameworkはWindowsオペレーティングシステムで実行されますが、他のオペレーティングシステムで実行されるバージョンから選択することもできます。 Monoは.NETFrameworkのオープンソースバージョンです。C#コンパイラが含まれており、さまざまなバージョンのLinuxやMacOSなどのさまざまなオペレーティングシステムで実行できます。\n</p>');
INSERT INTO `think_article_category` VALUES (33, 'vb', 'vb', '', 31, 0, 1, 0, 'vbチュートリアル、vbプログラミング、vb、vbエントリ、ビジュアルプログラミング、オブジェクト指向、マルチスレッド、ネットワークプログラミング、データベースプログラミング、フォーム、コントロール', 'Visual Basicは、Microsoftによって開発された、構造化されたモジュール式のオブジェクト指向のビジュアルプログラミング言語であり、開発環境を支援するイベント駆動型メカニズムが含まれています。 このサイトでは、VBプログラミングのフォーム、コントロール、属性、メソッドなどの基本的な知識の例と、デスクトップアプリケーションおよびネットワークプログラミングの多数のアプリケーション例と関連するプログラミング資料を提供しています。', '/uploads/images/20211019\\b2b9a9de5662e024a903a45e71476664.png', '<h1>\n    vb\n</h1>\n<p>\n    Visual BaicはBASICプログラミング言語から生まれました。VBは、グラフィカルユーザインターフェース（GUI）と高速アプリケーション開発（RAD）システムを有しており、DAO、RDO、ADO接続データベースを簡単に使用することができ、またはActive Xコントロールを簡単に作成し、タイプの安全と対象に向けたアプリケーションを効率的に生成することができる。プログラマは、VBが提供するコンポーネントを簡単に使用して、アプリケーションを迅速に確立することができます。\n</p>\n<p>\n    要約すると、VisualBasicには次の特徴があります。：\n</p>\n<ul class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            ビジュアルデザインプラットフォーム\n        </p>\n    </li>\n    <li>\n        <p>\n            イベント駆動型プログラミングメカニズム\n        </p>\n    </li>\n    <li>\n        <p>\n            モジュール式で構造化されたプログラミング言語です\n        </p>\n    </li>\n    <li>\n        <p>\n            強力なデータベース機能を備えています\n        </p>\n    </li>\n    <li>\n        <p>\n            豊富なActiveXテクノロジー\n        </p>\n    </li>\n    <li>\n        <p>\n            強力なネットワーク機能\n        </p>\n    </li>\n</ul>\n<p>\n    Visual Basicでは、オブジェクトの特性は、プロパティ、メソッド、およびイベントを通じて記述および測定できます。 さらに、フォームプロジェクトに関連する多数のコントロールがVisualBasic開発で使用されます。 ただし、Visual Basic言語には、継承がない、マルチスレッドのネイティブサポートがない、例外処理が不完全であるなど、3つの明らかな欠点があります（これらの欠点はvb.netで改善されています）。\n</p>');
INSERT INTO `think_article_category` VALUES (34, 'vb.net', 'vb.net', '', 31, 0, 1, 0, 'vb.netチュートリアル、vb.netプログラミング、vb.net、vb.netエントリ、オブジェクト指向、データベース、マルチスレッド、ネットワークプログラミング、データベースプログラミング', 'Visual Basic.NETは、Microsoft .NETFrameworkに基づくオブジェクト指向プログラミング言語です。 デバッグ時にはインタプリタ言語で動作し、出力はコンパイル言語で動作するEXEプログラムです。 このサイトでは、vb.net配列、データベース、オブジェクト指向などのプログラミングの基本とスキルのほか、ウィンドウ、グラフィックスと画像、Web操作などの操作に関連する例と資料を提供しています。', '/uploads/images/20211019\\46d632b0876e17a8f0f9c41c0dc34f77.png', '<h1>vb.net</h1><p>Visual Basic .NETは、Basicファミリーの言語に属しています。その文法機能は、自然言語に非常によく似た親和性の高い英語の単語と論理式に基づいています。VB.NETコードを書くことは、英語の文章を書くことに似ていると感じることがあります。 、この観点から、VB.NETは最も高度なプログラミング言語のようです。もちろん、VB.NETは確かにこれまでのところBasic言語で最も強力なプログラミング言語です。</p><p>Visual Basic .NETは、オブジェクト指向のサポートを強化する.NetFrameworkプラットフォーム上のVisualBasicのアップグレードバージョンと見なすことができます。</p><p>VB.Netには多くの強力なプログラミング機能があります。要約すると、次の点があります：<br/></p><ul class=\" list-paddingleft-2\"><li><p>ブール条件</p></li><li><p>自動ガベージコレクション</p></li><li><p>標準ライブラリ</p></li><li><p>アセンブリバージョン管理</p></li><li><p>プロパティとイベント</p></li><li><p>委任とイベント管理</p></li><li><p>ジェネリックを使いやすい</p></li><li><p>インデクサー</p></li><li><p>条件付きコンパイル</p></li><li><p>シンプルなマルチスレッド</p></li></ul><p>VB .NETは、.Netフレームワーク上に構築されています。 したがって、.NetFramework内のすべてのライブラリに完全にアクセスできます。 VB.NETプログラムは、.NETのオープンソース代替手段であるMonoで、Windowsだけでなく、LinuxまたはMacOSXでも実行できます。</p>');
INSERT INTO `think_article_category` VALUES (35, 'C 语言', 'C言語', '', 31, 0, 1, 0, 'C言語チュートリアル、Cプログラミング、C言語、Cエントリ、配列、文​​字列、ポインタ、アルゴリズム、データ構造、ネットワークプログラミング、データベースプログラミング', 'C言語は高級コンピュータープログラミング言語です。設計目標は、低水準メモリを簡単な方法でコンパイルおよび処理し、少量の機械語を生成し、オペレーティング環境のサポートなしで実行できるプログラミング言語を提供することです。 。 このサイトでは、配列、文​​字列、ポインター、構造体などのC言語に関連する基本的な例と手法、およびシステム関数アプリケーション、データ構造、アルゴリズム関連の資料を提供しています。', '/uploads/images/20211019\\9f8275ca989f7b5d72a183be136cc774.png', '<h1>\n    C言語\n</h1>\n<p>\n    C言語は広く使用されているコンピューター言語であり、Javaプログラミング言語と同じくらい人気があり、どちらも現代のソフトウェアプログラマーの間で広く使用されています。 最新のC言語標準はC11であり、それ以前のC言語標準はC99です。 C言語は、オペレーティングシステムの開発、ソフトウェアの開発、組み込みの開発でよく使用されます。\n</p>\n<p>\n    C言語には次の特徴があります：\n</p>\n<ul class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            ハイレベル言語\n        </p>\n    </li>\n    <li>\n        <p>\n            構造化言語\n        </p>\n    </li>\n    <li>\n        <p>\n            コードレベルのクロスプラットフォーム\n        </p>\n    </li>\n    <li>\n        <p>\n            ポインタを使用する\n        </p>\n    </li>\n    <li>\n        <p>\n            プリコンパイル済み処理\n        </p>\n    </li>\n</ul>\n<p>\n    さらに、C言語には、柔軟な表現、高い実行効率、優れた移植性など、多くの利点があります。 ただし、C言語のデータカプセル化には特定のセキュリティ上の欠陥があります（これはC ++で大幅に改善されています）。 データチェックが不十分だと、プログラマーはプログラムに精通する必要があります。\n</p>');
INSERT INTO `think_article_category` VALUES (36, 'Java编程', 'Javaプログラミング', '', 31, 0, 2, 0, 'Javaチュートリアル、Javaプログラミング、Javaエントリ、j2se、j2me、j2ee、struts、spring、hibernate、ネットワークプログラミング、データベースプログラミング', 'Javaは、クロスプラットフォームのアプリケーションソフトウェアを記述できるオブジェクト指向プログラミング言語です。これは、1995年5月にSun MicrosystemsによってリリースされたJavaプログラミング言語およびJavaプラットフォーム（つまり、JavaEE、JavaME、JavaSE）の総称です。 このサイトは、Javaフレームワークの支柱、Spring、Hibernateなどに基づいたデスクトップアプリケーション、Webインタラクション、モバイル端末開発のスキルと資料を提供します。', '/uploads/images/20211019\\ada0bc5c3cd7eaae547e73a57fcfcfc4.png', '<h1>\n    Javaプログラミング\n</h1>\n<p>\n    Javaには、単純さ、オブジェクト指向、分散、堅牢性、セキュリティ、プラットフォームの独立性と移植性、マルチスレッド、およびダイナミクスの特性があります。 Javaは、デスクトップアプリケーション、Webアプリケーション、分散システム、および組み込みシステムアプリケーションを作成できます。\n</p>\n<p>\n    Javaは、ビデオゲーム開発、Androidアプリケーション開発、デスクトップGUI、ソフトウェア開発などの分野で広く使用されています。 また、j2se、j2me、j2eeも、以下のようにそれぞれの分野で非常に幅広い用途があります：\n</p>\n<ul class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            Android開発アプリケーション\n        </p>\n    </li>\n    <li>\n        <p>\n            金融業界アプリケーション用のサーバープログラム\n        </p>\n    </li>\n    <li>\n        <p>\n            ウェブサイトの開発\n        </p>\n    </li>\n    <li>\n        <p>\n            埋め込みフィールド\n        </p>\n    </li>\n    <li>\n        <p>\n            ビッグデータテクノロジー\n        </p>\n    </li>\n    <li>\n        <p>\n            高頻度取引のためのスペース\n        </p>\n    </li>\n    <li>\n        <p>\n            科学的アプリケーション\n        </p>\n    </li>\n</ul>\n<p>\n    Javaプログラミングの基本には、変数、定数、フロー制御、オブジェクト指向、IOフロー制御、ネットワークプログラミングなどが含まれます。\n</p>');
INSERT INTO `think_article_category` VALUES (37, 'Delphi', 'Delphi', '', 31, 0, 1, 0, 'Delphiチュートリアル、Delphiプログラミング、Delphi、Delphiの概要、メソッド、フォーム、コントロール、オブジェクト指向、ネットワークプログラミング、データベースプログラミング', 'Delphiは、Windowsプラットフォームでよく知られているRapid Application Developmentツール（Rapid Application Development、RAD）です。 最も初期のバージョンは、1995年にアメリカのボーランド社によって開発されました。 オブジェクト指向プログラミングを中心としたアプリケーション開発ツールです。 このサイトでは、コントロール、メソッド、属性など、Delphiに関連する基本的なスキルとアプリケーション資料を提供しています。', '/uploads/images/20211019\\f7a09e8186d768fb4e47cf00fafe2155.png', '<h1>\n    Delphi\n</h1>\n<p>\n    Delphiは統合開発環境（IDE）です。使用されるコアは、従来のPascal言語から開発されたObject Pascalです。開発環境としてグラフィカルユーザーインターフェイスを使用し、IDE、VCLツール、およびコンパイラを使用して、データベース。オブジェクト指向プログラミングを中心としたアプリケーション開発ツール。 これは、Microsoft Windowsグラフィカルユーザーインターフェイスの多くの高度な機能と設計アイデアを使用し、柔軟で再利用可能な完全なオブジェクト指向言語（Object-Oriented Language）、今日の世界最速のコンパイラ、および最先端のデータベーステクノロジを採用しています。\n</p>\n<p>\n    Delphiの主な特性は以下を含む。：\n</p>\n<ul class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            直接コンパイルして実行可能コードを生成すると、コンパイル速度が速くなります。\n        </p>\n    </li>\n    <li>\n        <p>\n            アクセスルールがそれぞれクライアントまたはサーバーに渡される2つのスキームをサポートし、開発者が単純なコンポーネントまたはコンポーネントのコレクションを作成できるようにします\n        </p>\n    </li>\n    <li>\n        <p>\n            開発者が最小限の反復作業でさまざまなアプリケーションを完了することができるように、多くの高速で便利な開発方法が提供されています\n        </p>\n    </li>\n    <li>\n        <p>\n            再利用可能で拡張可能\n        </p>\n    </li>\n    <li>\n        <p>\n            強力なデータアクセス機能付き\n        </p>\n    </li>\n    <li>\n        <p>\n            強力なネットワーク開発機能を備えており、B / Sアプリケーションを迅速に開発できます\n        </p>\n    </li>\n    <li>\n        <p>\n            Delphiは独自のVCLクラスライブラリを使用しており、作成されたプログラムが整理されて明確に見えるようにします\n        </p>\n    </li>\n    <li>\n        <p>\n            Delphi8以降、Delphiは.Netフレームワークでのプログラム開発もサポートしています\n        </p>\n    </li>\n</ul>\n<p>\n    現在のDELPHI製品はCodeGearによって継続的に開発されています。CodeGearは開発者にDELPHIFOR PHPを提供します。これは、オブジェクト指向のPHP Webサイト開発を視覚的に完全にサポートし、PHP開発Webサイトのコード再利用の度合いを大幅に向上させてWEBアプリケーションになります。 。新しい武器が開発されました。\n</p>');
INSERT INTO `think_article_category` VALUES (38, 'java', 'java', '', 31, 0, 1, 0, 'Javaチュートリアル、Javaプログラミング、Javaエントリ、j2se、j2me、j2ee、struts、spring、hibernate、ネットワークプログラミング、データベースプログラミング', 'Javaは、クロスプラットフォームのアプリケーションソフトウェアを記述できるオブジェクト指向プログラミング言語です。これは、1995年5月にSun MicrosystemsによってリリースされたJavaプログラミング言語およびJavaプラットフォーム（つまり、JavaEE、JavaME、JavaSE）の総称です。 このサイトは、Javaフレームワークの支柱、Spring、Hibernateなどに基づいたデスクトップアプリケーション、Webインタラクション、モバイル端末開発のスキルと資料を提供します。', '/uploads/images/20211019\\583db544923a85019a2ee01331d14a11.png', '<h1>java</h1><p>Javaは、クロスプラットフォームのアプリケーションソフトウェアを記述できるオブジェクト指向プログラミング言語です。これは、1995年5月にSun MicrosystemsによってリリースされたJavaプログラミング言語およびJavaプラットフォーム（つまり、JavaEE、JavaME、JavaSE）の総称です。 このサイトは、Javaフレームワークの支柱、Spring、Hibernateなどに基づいたデスクトップアプリケーション、Webインタラクション、モバイル端末開発のスキルと資料を提供します。</p>');
INSERT INTO `think_article_category` VALUES (39, 'Android', 'Android', '', 31, 0, 1, 0, 'Androidチュートリアル、Androidプログラミング、Android', 'Androidは、Linuxをベースにした無料のオープンソースオペレーティングシステムです。主にスマートフォンやタブレットなどのモバイルデバイスに使用されます。GoogleとOpen Mobile Allianceが主導、開発しています。開発言語としてJavaが使用されています。このサイトインターフェース、コンポーネント、マルチメディア、その他のスキルを説明し、関連情報を提供するための多数の例とともに、Androidの開発に関連するレイアウト設計と機能実装方法を提供します', '/uploads/images/20211019\\5ee392fe5b177f1935c5894278701afa.png', '<h1>\n    Android\n</h1>\n<p>\n    Androidアプリケーションの開発では、通常、Java言語で開発されたAndroidソフトウェア開発キットを使用します。 Android開発は、美しいUIインターフェース、強力なマルチメディアサポート、マルチタッチ、マルチタスク、多言語サポート、およびその他の多くの利点を提供します。\n</p>\n<p>\n    Android開発の学習は通常次のような部分が含まれています。：\n</p>\n<ul class=\" list-paddingleft-2\">\n    <li>\n        <p>\n            アプリケーションコンポーネントの開発\n        </p>\n    </li>\n    <li>\n        <p>\n            リソース管理\n        </p>\n    </li>\n    <li>\n        <p>\n            アクティビティアクティビティコントロール\n        </p>\n    </li>\n    <li>\n        <p>\n            サービスサービス管理\n        </p>\n    </li>\n    <li>\n        <p>\n            放送放送管理\n        </p>\n    </li>\n    <li>\n        <p>\n            コンテンツプロバイダー\n        </p>\n    </li>\n    <li>\n        <p>\n            シャード管理\n        </p>\n    </li>\n    <li>\n        <p>\n            インテントとフィルター\n        </p>\n    </li>\n</ul>\n<p>\n    ここでは、インストール環境の確立から、Android開発の常識を段階的に説明します。\n</p>');
INSERT INTO `think_article_category` VALUES (40, 'IOS', 'IOS', '', 31, 0, 1, 0, 'IOSチュートリアル、IOSプログラミング、IOS、IOSエレメンタリーチュートリアル、Objective-C', 'iOSはAppleによって開発されたモバイルオペレーティングシステムです。Appleは2007年1月9日のMacworldカンファレンスでこのシステムを最初に発表しました。元々はiPhone用に設計され、後にiPod touch、iPad、およびAppleTV製品に適用されました。開発のためのObjective-C。iOS開発に関連するビュー、レイアウト、メモリ管理関連のスキル、およびアプリケーション例を提供します。', '/uploads/images/20211019\\539495c17184fc3ffefd6726d2fbe0ce.png', '<h1>IOS</h1><p>iOSオペレーティングシステムで一般的に使用される開発言語は、ObjictiveCまたはSwift言語です。 iPhoneおよびiPadアプリケーションの開発に使用できます。</p><p>一般的なiOS開発には次のものが含まれます：</p><ul class=\" list-paddingleft-2\"><li><p>カメラ管理</p></li><li><p>オーディオとビデオ</p></li><li><p>センサー</p></li><li><p>マップ開発</p></li><li><p>ファイル処理</p></li><li><p>GPS開発</p></li><li><p>メモリ管理</p></li><li><p>ゲーム開発</p></li></ul><p>iOS開発者は、個人の選択に応じてObjictiveCまたはSwift言語で開発できます。</p>');
INSERT INTO `think_article_category` VALUES (41, 'Swift', 'Swift', '', 31, 0, 1, 0, 'Swiftチュートリアル、Swiftプログラミング、Swift、Swiftの紹介', 'Swiftは、2014年にWWDC（Apple Developer Conference）でAppleによってリリースされた新しい開発言語です。MacOSおよびiOSプラットフォームでObjective-C *と一緒に実行して、Appleプラットフォームに基づくアプリケーションを構築できます。このサイトは迅速な閉鎖を提供します使用例オブジェクト、インターフェース、インターフェース設計、APPアプリケーション開発スキルおよび関連資料などの基本的な概念の。', '/uploads/images/20211019\\5430268d5030a1087b2b7f4f073b5311.png', '<h1>Swift</h1><p>Swiftは、iOSおよびmacOSアプリケーションを作成するための新しいプログラミング言語です。 SwiftはCとObjective-Cの利点を組み合わせており、Cの互換性によって制限されません。 Swiftは安全なプログラミングモデルを採用し、プログラミングをより簡単に、より柔軟に、そしてより面白くする多くの新機能を追加します。</p><p>Swiftには、主に次のような他の多くの機能があります。：</p><ul class=\" list-paddingleft-2\"><li><p>クロージャと関数ポインタの統合</p></li><li><p>タプルと複数の戻り値</p></li><li><p>一般</p></li><li><p>迅速で簡潔な範囲または反復のコレクション</p></li><li><p>サポートされているメソッド、拡張プロトコル構造。</p></li><li><p>マッピングやフィルターなどの関数型プログラミングモデル</p></li></ul><p>Swiftプログラミングの学習には、共通の変数、定数、演算子、フロー制御、文字列、配列、クラス、クロージャ、アクセス制御などが含まれます。</p>');
INSERT INTO `think_article_category` VALUES (42, 'Scala', 'Scala', '', 31, 0, 2, 0, 'Scala、パラダイムプログラミング、Scalaオブジェクトプログラミング', 'Scalaはマルチパラダイムプログラミング言語であり、Javaに似たプログラミング言語です。[1]設計の本来の目的は、スケーラブルな言語[2]を実装し、オブジェクト指向プログラミングと機能プログラミングのさまざまな機能を統合することです。', '/uploads/images/20211019\\be38d32785d840e21ef33678ff7afbe2.png', '<h1>Scala</h1><p>Scalはまた、高次関数、ローカル・スリーブ（Currying）、ネスト関数（Nested Function）、シーケンス解読（Sequence Compprehensions）などのいくつかの関数式言語のキー概念を含んでいる。<br/></p><p>Scalaは静的に型付けされているため、ジェネリッククラス、内部クラス、さらにはポリモーフィックメソッドを提供できます。 ScalaはJavaおよび.NETと相互運用するように特別に設計されていることにも言及する価値があります。 Scalaの現在のバージョンは.NETで実行できませんが、将来的には.NETで実行する予定です。<br/></p><p>ScalaはJavaと相互運用できます。 scalacコンパイラを使用して、ソースファイルをJavaクラスファイル（つまり、JVMで実行されるバイトコード）にコンパイルします。 ScalaからすべてのJavaライブラリを呼び出すことができます。また、JavaアプリケーションからScalaコードを呼び出すこともできます。</p><p>Scalaの機能には次のものが含まれます：</p><ul class=\" list-paddingleft-2\"><li><p>オブジェクト指向機能</p></li><li><p>関数型プログラミング</p></li><li><p>静的タイプ</p></li><li><p>スケーラビリティ</p></li><li><p>並行性</p></li><li><p>Scalaフレームワークを使用できます</p></li></ul><p>全体として、Javaと比較して、Scalaはより簡潔で、合理的で、効率的で、強力です。</p>');
INSERT INTO `think_article_category` VALUES (43, '汇编语言', 'アセンブリ言語', '', 31, 0, 1, 0, 'アセンブリ言語', 'アセンブリ言語は、電子コンピュータ、マイクロプロセッサ、マイクロコントローラ、またはその他のプログラマブルデバイスで使用される低水準言語であり、シンボリック言語とも呼ばれます。', '/uploads/images/20211019\\48636c26b7fe493e8e09b0551c9efb53.png', '<h1>アセンブリ言語</h1><p>アセンブリ言語は、電子コンピュータ、マイクロプロセッサ、マイクロコントローラ、またはその他のプログラマブルデバイスで使用される低水準言語であり、シンボリック言語とも呼ばれます。 アセンブリ言語では、ニーモニックはマシン命令のオペコードを置き換えるために使用され、アドレス記号またはラベルは命令またはオペランドのアドレスを置き換えるために使用されます。 さまざまなデバイスで、アセンブリ言語はさまざまな機械語命令セットに対応し、アセンブリプロセスを通じて機械語命令に変換されます。 一般的に、特定のアセンブリ言語と特定の機械語命令セットの間には1対1の対応があり、異なるプラットフォーム間で直接移植することはできません。</p>');
INSERT INTO `think_article_category` VALUES (44, 'R语言', 'R言語', '', 31, 0, 1, 0, 'R言語、統計分析、描画、データマイニング', 'R言語は、数学研究者向けに設計された数学プログラミング言語であり、主に統計分析、描画、およびデータマイニングに使用されます。', '/uploads/images/20211019\\aa0cab1171cc7886b3a0de25fba72317.png', '<h1>\n    R言語\n</h1>\n<p>\n    R言語は、数学研究者向けに設計された数学プログラミング言語であり、主に統計分析、描画、およびデータマイニングに使用されます。\n</p>\n<p>\n    あなたがコンピュータプログラムの初心者であり、一般的なコンピュータプログラミングについて学びたいと思っているなら、R言語は理想的な選択ではありません。Python、C、またはJavaを選択できます。\n</p>\n<p>\n    R言語とC言語はどちらもベル研究所の研究成果ですが、焦点が異なります。R言語は数学的理論研究者向けの解釈言語であり、C言語はコンピューターソフトウェアエンジニア向けに設計されています。\n</p>\n<p>\n    R言語は解釈と操作のための言語です（C言語のコンパイルと操作とは異なります）。その実行速度はC言語よりもはるかに遅く、最適化に役立ちません。 ただし、文法レベルでより豊富なデータ構造操作を提供し、テキストやグラフィック情報を非常に便利に出力できるため、数学、特に統計で広く使用されています。\n</p>\n<p>\n    R言語公式サイト：<a rel=\"nofollow\" target=\"_blank\" href=\"https://cran.r-project.org/\">https://cran.r-project.org/</a>\n</p>\n<p>\n    R言語公式ミラーサイト一覧：<a rel=\"nofollow\" target=\"_blank\" href=\"https://cran.r-project.org/mirrors.html\">https://cran.r-project.org/mirrors.html</a>\n</p>\n<p>\n    R言語ヘルプマニュアル：<a rel=\"nofollow\" target=\"_blank\" href=\"https://cran.r-project.org/manuals.html\">https://cran.r-project.org/manuals.html</a>\n</p>');
INSERT INTO `think_article_category` VALUES (45, '数据库', 'データベース', 'database', 0, 1, 1, 4, 'データベース、アクセス、Mysql、MsSql、データベースダイジェスト', 'データベース(Database)は、データ構造に従ってデータを整理、保存、管理するウェアハウスです。 さまざまなデータを格納する最も単純なテーブルから、大量のデータを格納できる大規模なデータベースシステムまで、さまざまな種類のデータベースがあり、あらゆる面で広く使用されています。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (46, 'MsSql', 'MsSql', '', 45, 0, 1, 0, 'Microsoft SQL Server、MSSQL、SQLServer', 'MS SQLは、MicrosoftのSQLServerデータベースサーバーを指します。これは、サーバーから端末までのデータベースに完全なソリューションを提供するデータベースプラットフォームです。データベースサーバー部分は、データベースを確立、使用、および保守するためのデータベース管理システムです。', '/uploads/images/20211019\\de1a9a1b5d0c0f40efc658ec89cae936.png', '<h1>MsSql</h1><p>MS SQLは、MicrosoftのSQLServerデータベースサーバーを指します。これは、サーバーから端末までのデータベースに完全なソリューションを提供するデータベースプラットフォームです。データベースサーバー部分は、データベースを確立、使用、および保守するためのデータベース管理システムです。 SQL Serverは、当初はMicrosoft自身が開発した製品ではありませんでしたが、IBMと競合する際にSybaseと協力して作成されました。初期の開発者はSybaseでした。同時に、MicrosoftはSybaseと協力してSQL Server4.2バージョン。MicrosoftはSQLServer4.2もWindowsNTに移植しました。Sybaseとのパートナーシップを終了した後、SQL Server6.0を独自に開発しました。以降のすべてのSQLServerはMicrosoft自身が開発します。</p><p>SQL Server 2012の最新バージョンには、AlwaysOnクラスターと可用性グループによって実現される高可用性およびディザスタリカバリソリューション、高速クエリ速度のためのxVelocityインメモリストレージ、AnalysisServicesのPowerViewとテーブルの高速データブラウジングとスケーラブルなビジネスなどの機能が追加されています。モデリングによるインテリジェンス、およびData QualityServicesによってもたらされる新しいデータ管理機能。</p>');
INSERT INTO `think_article_category` VALUES (47, 'Mysql', 'Mysql', '', 45, 0, 1, 0, 'MySQL、MySQL最適化、MySQL構成、MySQLマニュアル、MySQL情報、MySQL5、MySQLインストール、MySQLチュートリアル、MySQLデータベース', 'MySQLは、スウェーデンの会社MySQL ABによって開発されたリレーショナルデータベース管理システムであり、現在はOracleの会社に属しています。 MySQLは最も人気のあるリレーショナルデータベース管理システムです。Webアプリケーションの観点から、MySQLは最高のRDBMS（リレーショナルデータベース管理システム）アプリケーションソフトウェアの1つです。', '/uploads/images/20211019\\9ae6effdd108abb230b9ea78e58ac23c.png', '<h1>Mysql</h1><p>Mysqlは最も人気のあるリレーショナルデータベース管理システムであり、MySQLはWebアプリケーションの観点から最高のRDBMS(Relational Database Management System：リレーショナルデータベース管理システム)アプリケーションソフトウェアの1つです。</p><p>MySQLはリレーショナルデータベース管理システムです。リレーショナルデータベースは、すべてのデータを大規模なウェアハウスに配置するのではなく、異なるテーブルにデータを格納するため、速度と柔軟性が向上します。</p><ul class=\" list-paddingleft-2\"><li><p>MySQLはオープンソースであるため、追加料金を支払う必要はありません。</p></li><li><p>MySQLは大規模なデータベースをサポートしています。 数千万のレコードを持つ大規模なデータベースを処理できます。</p></li><li><p>MySQLは、標準のSQLデータ言語形式を使用します。</p></li><li><p>MySQLは複数のシステムで実行でき、複数の言語をサポートします。 これらのプログラミング言語には、C、C ++、Python、Java、Perl、PHP、Eiffel、Ruby、Tclなどが含まれます。</p></li><li><p>MySQLは、現在最も人気のあるWeb開発言語であるPHPを非常によくサポートしています。</p></li><li><p>MySQLは大規模なデータベース、5,000万レコードのデータウェアハウス、32ビットシステムテーブルファイルは最大4 GB、64ビットシステムは最大8TBのテーブルファイルをサポートします。</p></li><li><p>MySQLは、GPL契約を使用してカスタマイズできます。ソースコードを変更して、独自のMysqlシステムを開発できます。</p></li></ul>');
INSERT INTO `think_article_category` VALUES (48, 'mariadb', 'mariadb', '', 45, 0, 1, 0, 'mariadb、mariadbチュートリアル、mariadbドキュメント、mariadbオープンソース、mariadbストレージ', 'MariaDBデータベース管理システムはMySQLのブランチであり、主にオープンソースコミュニティによって維持されています。GPLライセンスを使用する目的MariaDBは、APIやコマンドラインを含むMySQLと完全に互換性があるため、MySQLの代わりになります。 ストレージエンジンに関しては、MySQLのInnoDBの代わりにXtraDB（英語：XtraDB）が使用されます。', '/uploads/images/20211019\\ab8bcc7626ff974ea8a85dab9eb0a674.png', '<h1>mariadb</h1><p>MariaDBデータベース管理システムはMySQLのブランチであり、主にオープンソースコミュニティによって維持されています。GPLライセンスを使用する目的MariaDBは、APIやコマンドラインを含むMySQLと完全に互換性があるため、MySQLの代わりになります。 ストレージエンジンに関しては、MySQLのInnoDBの代わりにXtraDB（英語：XtraDB）が使用されます。 MariaDBは、MySQLの創設者であるMichael Widenius（英語：Michael Widenius）によって開発されました。彼は自分が作成したMySQL ABをSUNに10億米ドルで売却しました。それ以来、SUNがOracleに買収されると、MySQLの所有権も手に入ります。オラクルの。 MariaDBの名前は、MichaelWideniusの娘であるMariaの名前に由来しています。</p><p>MariaDBのトランザクションベースのMariaストレージエンジンは、MySQLのMyISAMストレージエンジンに置き換わるもので、InnoDBのバリアントであるPerconaのXtraDBを使用します。ブランチの開発者は、今後のMySQL 5.4InnoDBパフォーマンスへのアクセスを提供したいと考えています。 このバージョンには、PrimeBase XT（PBXT）およびFederatedXストレージエンジンも含まれています。</p><p>MySQLと比較して、MariaDBは次の点で強力です：</p><ul class=\" list-paddingleft-2\"><li><p>Mariaストレージエンジン</p></li><li><p>PBXTストレージエンジン</p></li><li><p>XtraDBストレージエンジン</p></li><li><p>FederatedXストレージエンジン</p></li><li><p>より高速なコピークエリ処理</p></li><li><p>スレッドプール</p></li><li><p>警告とバグが少ない</p></li><li><p>より速く実行</p></li><li><p>その他の拡張機能（More index parts, new startup options etc）</p></li><li><p>より優れた機能テスト</p></li><li><p>データシートの削除</p></li><li><p>遅いクエリログの拡張された統計</p></li><li><p>Unicodeソートをサポート</p></li></ul><p>MySQL 5.6の最新バージョンと比較して、MariaDBには、パフォーマンス、機能、管理、およびNoSQL拡張機能の点でより豊富な機能が含まれています。 たとえば、マイクロ秒のサポート、スレッドプール、サブクエリの最適化、グループの送信、進捗レポートなどです。</p>');
INSERT INTO `think_article_category` VALUES (49, 'oracle', 'oracle', '', 45, 0, 1, 0, 'ORACLE、ORACLEデータベース、Oracle10gチュートリアル、Oracleデータベースチュートリアル', 'OracleDatabaseまたは略してOracle。 リレーショナルデータベース管理システムです。 これは、データベース分野で常に主導的な地位を占めてきた製品です。 Oracleデータベースシステムは、移植性に優れ、使い勝手が良く、機能も充実している、世界で人気のリレーショナルデータベース管理システムと言えます。 これは、高効率、信頼性、高スループットのデータベースソリューションです。', '/uploads/images/20211019\\fa21ca4c2f6705b16de4cfffcd471c09.png', '<h1>oracle</h1><p>Oracle Database、別名Oracle RDBMS、または略してOracle。 Oracleのリレーショナルデータベース管理システムです。 これは、データベース分野で常に主導的な地位を占めてきた製品です。 Oracleデータベースシステムは、世界で人気のあるリレーショナルデータベース管理システムと言えます。携帯性、使いやすさ、機能性に優れ、大・中・小・マイクロコンピュータのあらゆる環境に対応しています。 これは、高効率、信頼性、高スループットのデータベースソリューションです。</p><p><strong>特徴：</strong></p><p>1、完全なデータ管理機能</p><p>2、完全な関係を持つ製品</p><p>3、分散処理機能</p><p>4、データウェアハウスの運用はORACLEで簡単に実現できます</p><p><strong>アドバンテージ：</strong></p><ul class=\" list-paddingleft-2\"><li><p>強力なユーザビリティ</p></li><li><p>強力なスケーラビリティ</p></li><li><p>強力なデータセキュリティ</p></li><li><p>強力な安定性</p></li></ul><p>Oracleデータベースの最新バージョンはOracleDatabase12cです。 Oracle Database 12cでは、データベースクラウドを簡単にデプロイおよび管理するために使用できる新しいマルチテナントアーキテクチャが導入されています。</p>');
INSERT INTO `think_article_category` VALUES (50, 'DB2', 'DB2', '', 45, 0, 2, 0, 'DB2、DB2データベース、DB2チュートリアル、DB2データベースチュートリアル', 'DB2は、IBMによって作成された一連のリレーショナル・データベース管理システムであり、さまざまなオペレーティング・システムのUNIX、Windows Access、およびORACLEプラットフォームで機能します。 DB2は、主に大規模なアプリケーションシステムで使用され、スケーラビリティが高く、メインフレームからシングルユーザー環境までサポートでき、OS / 2やWindowsなどのプラットフォームに適用されます。', '/uploads/images/20211019\\fd6e2a0542469570442fa244392379e4.png', '<h1>\n    DB2\n</h1>\n<p>\n    DB2は、主流のOS / 390およびVMオペレーティング・システム、ならびに中規模のAS / 400システムを提供できるほか、クロスプラットフォーム（UNIXベースのLINUX、HP-UX、SunSolaris、およびSCOUnixWareを含む）も提供します。パーソナルコンピュータのOS / 2オペレーティングシステム、およびMicrosoftのWindows2000とその以前のシステムのDB2製品について。 DB2データベースには、MicrosoftのOpen Database Connectivity（ODBC）インターフェース、Java Database Connectivity（JDBC）インターフェース、またはCORBAインターフェースプロキシを使用して、任意のアプリケーションからアクセスできます。\n</p>\n<p>\n    DB2は、IBMの分散データベースソリューションです。 簡単に言うと、DB2は、IBMによって開発された大規模なリレーショナルデータベースプラットフォームです。 複数のユーザーまたはアプリケーションをサポートして、同じSQLステートメントで異なるデータベースまたは異なるDBMSのデータをクエリします。現在、DB2データベースには次のバージョンがあります：(DB2 for Unix,DB2 for Windows,DB2 for AS/400,DB2 for OS/390)。\n</p>');
INSERT INTO `think_article_category` VALUES (51, 'mssql2008', 'mssql2008', '', 45, 0, 1, 0, 'SQL Server 2008、MSSQL2008', 'SQL Server 2008は、任意のデータを整理および管理できるMicrosoftのデータプラットフォームでリリースされています。 構造化、半構造化、および非構造化ドキュメントのデータは、データベースに直接保存できます。 データの照会、検索、同期、レポート、および分析を行うことができます。', '/uploads/images/20211019\\6a109622c1b1e4d84ee41d7455ba01bd.png', '<h1>mssql2008</h1><p>SQL Server 2008バージョンでは、構造化、半構造化、および非構造化のドキュメントデータをデータベースに直接格納できます。 データの照会、検索、同期、レポート、および分析を行うことができます。 データは、データセンターの最大のサーバーからデスクトップコンピューターやモバイルデバイスまで、さまざまなデバイスに保存でき、データの保存場所に関係なくデータを制御できます。</p><p>さらに、SQL Server 2008では、Microsoft.NETとVisualStudioを使用して開発されたカスタムアプリケーションでデータを使用したり、Microsoft BizTalk Serverを介してサービス指向アーキテクチャ（SOA）とビジネスプロセスでデータを使用したりできます。 インフォメーションワーカーは、日常的に使用するツールを介してデータに直接アクセスできます。</p><p>エンタープライズバージョンのリリースに加えて、標準バージョン、ワークグループバージョン、180日間の試用評価バージョン、および中小規模のアプリケーションに適した無料の学習バージョンも提供します。</p>');
INSERT INTO `think_article_category` VALUES (52, 'mssql2005', 'mssql2005', '', 45, 0, 1, 0, 'SQL Server 2005、MSSQL2005', 'Microsoft SQL Server 2005は、統合ビジネスインテリジェンス（BI）ツールを使用してエンタープライズレベルのデータ管理を提供する包括的なデータベースプラットフォームです。 Microsoft SQL Server 2005データベースエンジンは、リレーショナルデータと構造化データ用のより安全で信頼性の高いストレージ機能を提供し、ビジネス向けの可用性とパフォーマンスの高いデータアプリケーションを構築および管理できるようにします。', '/uploads/images/20211019\\c951b563512886d77aa9152e2a43ac0d.png', '<h1>mssql2005</h1><div>Microsoft SQL Server 2005は、統合ビジネスインテリジェンス（BI）ツールを使用してエンタープライズレベルのデータ管理を提供する包括的なデータベースプラットフォームです。 Microsoft SQL Server 2005データベースエンジンは、リレーショナルデータと構造化データ用のより安全で信頼性の高いストレージ機能を提供し、ビジネス向けの可用性とパフォーマンスの高いデータアプリケーションを構築および管理できるようにします。</div><div>Microsoft SQL Server 2005データエンジンは、このエンタープライズデータ管理ソリューションの中核です。 さらに、Microsoft SQL Server 2005は、分析、レポート、統合、および通知機能を組み合わせたものです。 これにより、企業は費用対効果の高いBIソリューションを構築および展開し、チームがスコアカード、ダッシュボード、Webサービス、およびモバイルデバイスを介してビジネスのすべての領域にデータアプリケーションをプッシュできるようになります。</div><div>Microsoft Visual Studio、Microsoft Office System、および新しい開発キット（Business Intelligence Development Studioを含む）との緊密な統合により、Microsoft SQL Server2005は独自のものになっています。 Microsoft SQL Server 2005は、開発者、データベース管理者、インフォメーションワーカー、意思決定者のいずれであっても、データからより多くの利益を得るのに役立つ革新的なソリューションを提供します。</div><div>SQL Server 2005には、次の5つのバージョンがあります。</div><ul class=\" list-paddingleft-2\"><li><p>SQL Server 2005 Enterprise Edition（32ビットおよび64ビット）-Enterprise Edition</p></li><li><p>SQL Server 2005 Standard Edition（32ビットおよび64ビット）-Standard Edition</p></li><li><p>SQL Server 2005 Workgroup Edition（32ビットのみ）-Workgroup Edition</p></li><li><p>SQL Server 2005 Developer Edition（32ビットおよび64ビット）-Development Edition</p></li><li><p>SQL Server 2005 Express Edition（32ビットのみ）-Learning Edition</p></li></ul>');
INSERT INTO `think_article_category` VALUES (53, 'SQLite', 'SQLite', '', 45, 0, 1, 0, 'SQLite、SQLiteデータベース、SQLiteチュートリアル', '軽量データベースであるSQLiteは、ACIDに準拠したリレーショナルデータベース管理システムです。その設計目標は組み込まれており、多くの組み込み製品で使用されています。占有するリソースは非常に少なくなります。モバイルデバイスでは、わずか数百Kのメモリで十分かもしれません。', '/uploads/images/20211019\\8f3066f2c458c3978f1e2f40c9694ae2.png', '<h1>SQLite</h1><p>SQLiteは、自給自足のサーバーレス、ゼロ構成、トランザクションSQLデータベースエンジンを実装するソフトウェアライブラリです。 SQLiteは、世界で最も広く展開されているSQLデータベースエンジンです。 SQLiteソースコードは著作権制限の対象ではありません。</p><p>なぜSQLiteを使用するのですか？</p><ul class=\" list-paddingleft-2\"><li><p>個別のサーバープロセスやオペレーティングシステム（サーバーレス）は必要ありません。</p></li><li><p>SQLiteは構成を必要としません。つまり、インストールや管理は必要ありません。</p></li><li><p>完全なSQLiteデータベースは、単一のクロスプラットフォームディスクファイルに保存されます。</p></li><li><p>SQLiteは非常に小型で軽量であり、完全に構成されている場合は400KiB未満、オプション機能が省略されている場合は250KiB未満です。</p></li><li><p>SQLiteは自給自足です。つまり、外部の依存関係は必要ありません。</p></li><li><p>SQLiteトランザクションは完全にACID互換であり、複数のプロセスまたはスレッドからの安全なアクセスを可能にします。</p></li><li><p>SQLiteは、SQL92（SQL2）標準のほとんどのクエリ言語機能をサポートしています。</p></li><li><p>SQLiteはANSI-Cで記述されており、シンプルで使いやすいAPIを提供します。</p></li><li><p>SQLiteは、UNIX（Linux、Mac OS-X、Android、iOS）およびWindows（Win32、WinCE、WinRT）で実行できます。</p></li></ul><p>SQLiteは、自給自足のサーバーレス、ゼロ構成、トランザクションSQLデータベースエンジンを実装するインプロセスライブラリです。 これはゼロ構成データベースです。つまり、他のデータベースと同様に、システムで構成する必要はありません。</p>');
INSERT INTO `think_article_category` VALUES (54, 'PostgreSQL', 'PostgreSQL', '', 45, 0, 1, 0, 'PostgreSQL、PostgreSQLデータベース、PostgreSQLチュートリアル', 'PostgreSQLは、カリフォルニア大学バークレー校のコンピュータサイエンス学部によって開発されたPOSTGRESのバージョン4.2に基づくオブジェクトリレーショナルデータベース管理システム（ORDBMS）であり、現在はPostgreSQLに名前が変更されています。 PostgreSQLはほとんどのSQL標準をサポートし、複雑なクエリ、外部キー、トリガー、ビュー、トランザクションの整合性、MVCCなどの他の多くの最新機能を提供します。', '/uploads/images/20211019\\4fad2097a5f1c50c3feb5823c25562a1.png', '<h1>PostgreSQL</h1><p>PostgreSQLは、強力なオープンソースのオブジェクトリレーショナルデータベース管理システム（ORDBMS）です。 データを安全に保存するために使用されます。ベストプラクティスをサポートし、リクエストの処理時にデータを取得できるようにします。</p><p>PostgreSQL（Post-gress-Q-Lとも呼ばれます）は、PostgreSQLグローバル開発グループ（グローバルボランティアチーム）によって開発されています。 会社やその他の民間団体によって管理されているわけではありません。 これはオープンソースであり、そのソースコードは無料で入手できます。</p><p>PostgreSQLの特徴は以下のとおりです。</p><ul class=\" list-paddingleft-2\"><li><p>PostgreSQLは、すべての主要なオペレーティングシステム（Linux、UNIX（AIX、BSD、HP-UX、SGI IRIX、Mac OS X、Solaris、Tru64）、Windowsなど）で実行できます。</p></li><li><p>PostgreSQLはテキスト、画像、サウンド、ビデオをサポートし、C / C ++、Java、Perl、Python、Ruby、Tcl、Open Database Connectivity（ODBC）のプログラミングインターフェイスを備えています。</p></li><li><p>PostgreSQLは、複雑なSQLクエリ、SQL副選択、外部キー、トリガー、ビュー、トランザクション、マルチプロセス同時実行制御（MVCC）、ストリーミングレプリケーション（9.0）、ホットスタンバイ（9.0）などのSQLの多くの機能をサポートします。 ）。</p></li><li><p>PostgreSQLでは、「親」テーブルからその特性を継承するようにテーブルを設定できます。</p></li><li><p>複数の拡張機能をインストールして、PostgreSQLに機能を追加できます。</p></li></ul><p>PostgreSQLはクロスプラットフォームであり、Linux、FreeBSD、OS X、Solaris、MicrosoftWindowsなどの多くのオペレーティングシステムで実行できます。</p>');
INSERT INTO `think_article_category` VALUES (55, 'MongoDB', 'MongoDB', '', 45, 0, 1, 0, 'MongoDB、MongoDBデータベース、MongoDBチュートリアル', 'MongoDBは、IT業界で非常に人気のある非リレーショナルデータベース（NoSql）であり、その柔軟なデータストレージ方法は現在のIT実務家に好まれています。 Mongo DBは、オブジェクト指向思考（OO思考）を非常にうまく実装しています。MongoDBでは、すべてのレコードがDocumentオブジェクトです。', '/uploads/images/20211019\\e74b12d5b6b84d8a65977df86c3a833f.png', '<h1>MongoDB</h1><p>MongoDBは、分散ファイルストレージに基づくデータベースです。 C ++言語で書かれています。 WEBアプリケーションにスケーラブルで高性能なデータストレージソリューションを提供するように設計されています。</p><p>MongoDBは、リレーショナルデータベースと非リレーショナルデータベースの製品であり、非リレーショナルデータベースの中で最も用途が広く、リレーショナルデータベースに最も似ています。</p><p><strong>主な特徴</strong></p><ul class=\" list-paddingleft-2\"><li><p>MongoDBは、ドキュメントストレージ向けのデータベースであり、比較的シンプルで操作が簡単です。</p></li><li><p>MongoDBレコードに任意の属性インデックス（FirstName = &quot;Sameer&quot;、Address = &quot;8 Gandhi Road&quot;など）を設定して、より高速な並べ替えを実現できます。</p></li><li><p>ローカルまたはネットワークを介してデータミラーリングを作成できます。これにより、MongoDBがよりスケーラブルになります。</p></li><li><p>負荷が増加した場合（より多くのストレージスペースとより強力な処理能力が必要）、コンピューターネットワーク内の他のノードに分散できます。これはシャーディングと呼ばれます。</p></li><li><p>Mongoは豊富なクエリ式をサポートしています。クエリコマンドは、JSON形式のタグを使用して、ドキュメントに埋め込まれたオブジェクトと配列を簡単にクエリします。</p></li><li><p>MongoDbは、update（）コマンドを使用して、完成したドキュメント（データ）または指定されたデータフィールドを置き換えることができます。</p></li><li><p>MongodbのMap / reduceは、主にデータのバッチ処理と集計に使用されます。</p></li><li><p>MapandReduce。 Map関数はemit（key、value）を呼び出してコレクション内のすべてのレコードをトラバースし、キーと値をReduce関数に渡して処理します。</p></li><li><p>Map関数とReduce関数はJavascriptで記述されており、MapReduce操作はdb.runCommandまたはmapreduceコマンドを介して実行できます。</p></li><li><p>GridFSはMongoDBに組み込まれている関数であり、多数の小さなファイルを保存するために使用できます。</p></li><li><p>MongoDBを使用すると、サーバー側でスクリプトを実行できます。Javascriptで関数を記述してサーバー側で直接実行することも、サーバー側に関数定義を保存して次回直接呼び出すこともできます。</p></li><li><p>MongoDBは、RUBY、PYTHON、JAVA、C ++、PHP、C＃などのさまざまなプログラミング言語をサポートしています。</p></li><li><p>MongoDBは簡単にインストールできます。</p></li></ul><p>MongoDBは、WEBアプリケーション向けのスケーラブルで高性能なデータストレージソリューションを提供することを目的としています。</p>');
INSERT INTO `think_article_category` VALUES (56, 'Redis', 'Redis', '', 45, 0, 1, 0, 'Redis、Redisデータベース、Redisチュートリアル、Redis最適化', 'Redisは、ANSI C言語で記述されたオープンソースのログベースのKey-Valueデータベースであり、メモリベースまたは永続的なネットワークをサポートし、複数の言語でAPIを提供します。 2010年3月15日以降、Redisの開発はVMwareによってホストされています。', '/uploads/images/20211019\\f29e747f6427aa25d7f4ef8d856f27f6.png', '<h1>Redis</h1><p>Redisは、ANSI C言語で記述されたオープンソースのログベースのKey-Valueデータベースであり、メモリベースまたは永続的なネットワークをサポートし、複数の言語でAPIを提供します。 2010年3月15日以降、Redisの開発はVMwareによってホストされています。 2013年5月以降、Redisの開発はPivotalによって後援されています。</p><p>Redisおよびその他のKey-Valueキャッシング製品には、次の3つの特徴があります：</p><ul class=\" list-paddingleft-2\"><li><p>Redisはデータの永続性をサポートしています。メモリ内のデータはディスクに保存でき、再起動時に使用するために再度ロードできます。</p></li><li><p>Redisは、単純なKey-Valueタイプのデータをサポートするだけでなく、リスト、セット、zset、ハッシュ、およびその他のデータ構造のストレージも提供します。</p></li><li><p>Redisは、データバックアップ、つまりマスタースレーブモードでのデータバックアップをサポートしています。</p></li></ul><p><strong>Redisの利点</strong></p><ul class=\" list-paddingleft-2\"><li><p>高性能-Redisは110,000回/秒の読み取りと81,000回/秒の書き込みが可能です。</p></li><li><p>豊富なデータタイプ–RedisはバイナリケースのStrings，Lists，hashes，SetsおよびOrdered Setsデータタイプの操作をサポートします。</p></li><li><p>アトミック-すべてのRedis操作はアトミックです。つまり、正常に実行されるか、失敗した場合はまったく実行されません。 単一の操作はアトミックです。 複数の操作は、MULTIおよびEXEC命令によってパッケージ化されたトランザクション、つまりアトミック性もサポートします。</p></li><li><p>豊富な機能-Redisは、パブリッシュ/サブスクライブ、通知、キーの有効期限、およびその他の機能もサポートしています。</p></li></ul>');
INSERT INTO `think_article_category` VALUES (57, 'Access', 'Access', '', 45, 0, 1, 0, 'Microsoft Office Access、Accessデータベース', 'Microsoft Office Accessは、Microsoftがリリースしたリレーショナルデータベース管理システムです。 これは、Microsoft Jet Database Engineの2つの機能とグラフィカルユーザーインターフェイスを組み合わせたもので、MicrosoftOfficeのシステムプログラムの1つです。', '/uploads/images/20211019\\0f14e27b1babc6fd228dc27dc4ee00d8.png', '<h1>Access</h1><p>Microsoft Office Accessは、Microsoftがデータベースエンジンのグラフィカルユーザーインターフェイスとソフトウェア開発ツールを組み合わせたデータベース管理システムです。</p><p>アクセスの目的は、次の2つの側面に反映されています：</p><p><strong>1.データ分析に使用されます：</strong></p><p>Accessには、強力なデータ処理および統計分析機能があります。Accessのクエリ機能を使用すると、さまざまな要約および平均統計を簡単に実行できます。</p><p><strong>2.ソフトウェアの開発に使用： </strong></p><p>Accessは、生産管理、販売管理、在庫管理、その他のエンタープライズ管理ソフトウェアなどのソフトウェアの開発に使用されます。最大の利点は、習得が容易なことです。 コンピュータ以外の専門家も学ぶことができます。</p><p>さらに、いくつかの小さなWebサイトWEBアプリケーションを開発するときにデータを保存するために使用されます。 たとえば、ASP + Accessです。</p><p>Access2007には、デフォルトで次の4つの機能領域があります。</p><ul class=\" list-paddingleft-2\"><li><p>開始</p></li><li><p>作成</p></li><li><p>外部データ</p></li><li><p>データベースツール</p></li></ul><p>上記の4つの機能領域に加えて、デフォルトでは表示されない非表示の機能領域がいくつかあります。 特定の操作を行った場合のみ、関連する機能エリアが表示されます。 たとえば、テーブル作成操作を実行すると、「データテーブル」機能領域が自動的に開きます。</p>');
INSERT INTO `think_article_category` VALUES (58, '网站技巧', 'ウェブサイトのスキル', 'website_skills', 0, 1, 2, 5, 'ウェブサイトのスキル、ウェブサイトのアプリケーション、ウェブサイトの運用、サーバー、顧客とのコミュニケーション', 'オンラインマーケティングには多くの方法があります。企業のウェブサイトを効果的に宣伝するには、まず良いウェブサイトを用意する必要があります。良いウェブサイトとは何ですか。つまり、ウェブサイトの位置付けを明確にし、ユーザーターゲットグループを明確にする必要があります。 、そしてそれはユーザーに価値のあるサービスを提供できなければなりません。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (59, '网站应用', 'ウェブアプリケーション', '', 58, 0, 2, 0, 'ウェブサイトアプリケーション、seo検索最適化、seoウェブサイトキーワード最適化', 'ウェブサイトにSEOを使用して、ユーザーの検索品質を向上させ、セマンティクス、検索キーワードとコンテンツの関連性、包含量、検索ランキングなどの技術的な詳細を最適化する方法。', '/uploads/images/20211019\\a6fc9ae62f3775430f100a2f57b161e2.png', '<h1>ウェブアプリケーション</h1><p>ウェブサイトにSEOを使用して、ユーザーの検索品質を向上させ、セマンティクス、検索キーワードとコンテンツの関連性、包含量、検索ランキングなどの技術的な詳細を最適化する方法。</p>');
INSERT INTO `think_article_category` VALUES (60, '网站运营', 'ウェブサイトの運営', '', 58, 0, 2, 0, 'ウェブサイト運営、ネットワーク運営、ネットワークマーケティング', 'ウェブサイト運営とは、ユーザーにサービスを提供するウェブサイトの効率を改善するために、ウェブサイトのその後の運営および運営に関連するすべての行動作業を指します。範囲には通常、ウェブサイトコンテンツ更新のメンテナンス、ウェブサイトサーバーのメンテナンス、ウェブサイトプロセスの最適化、データマイニング分析が含まれます。ユーザー調査管理、ウェブサイトマーケティング計画など。', '/uploads/images/20211019\\a2fc8545477219acc9fb693547e4db5e.png', '<h1>ウェブサイトの運営</h1><p>ウェブサイト運営とは、ユーザーにサービスを提供するウェブサイトの効率を改善するために、ウェブサイトのその後の運営および運営に関連するすべての行動作業を指します。範囲には通常、ウェブサイトコンテンツ更新のメンテナンス、ウェブサイトサーバーのメンテナンス、ウェブサイトプロセスの最適化、データマイニング分析が含まれます。ユーザー調査管理、ウェブサイトマーケティング計画など。</p>');
INSERT INTO `think_article_category` VALUES (61, '服务器', 'サーバ', '', 58, 0, 2, 0, 'winサーバー、Linux / Apache、FTPサーバー、nginx、tomcat、zabbix', 'サーバーは、コンピューティングサービスを提供するデバイスです。 サーバーはサービス要求に応答してそれらを処理する必要があるため、一般に、サーバーはサービスを実行し、サービスを保証する機能を備えている必要があります。', '/uploads/images/20211019\\07472237f14936ee2eb83808a4b96704.png', '<h1>サーバ</h1><p>サーバーは、コンピューティングサービスを提供するデバイスです。 サーバーはサービス要求に応答してそれらを処理する必要があるため、一般に、サーバーはサービスを実行し、サービスを保証する機能を備えている必要があります。</p>');
INSERT INTO `think_article_category` VALUES (62, '网页制作', 'ウェブページの制作', 'website', 0, 1, 1, 6, 'ウェブページ制作、ウェブデザイン、ウェブページ制作チュートリアル、ウェブページデザインチュートリアル、ウェブページチュートリアル', 'Webページ作成、Webページ作成列には、Webページ作成設計チュートリアル、html、xhtml、css、dreamweaver、frontpage、js、xml、cms、スキルチュートリアルなどが含まれます。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (63, 'HTML/Xhtml', 'HTML/Xhtml', '', 62, 0, 1, 0, 'HTML、Xhtml', 'HTML / Xhtml列には、主にHTMLおよびXHTML構文、イベント、モジュール、コード、使用法、およびその他のWebテクノロジーチュートリアルコンテンツが含まれています。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (64, 'html5', 'html5', '', 62, 0, 1, 0, 'html5', 'HTML5には、主にHTML5アプリケーション開発、Webフォーム、オーディオとビデオ、Java描画キャンバスおよびその他のエフェクトの実装が含まれます。', '/uploads/images/20211019\\973dedaf8d82085fe45505f903f32e42.jpg', '<h1>html5</h1><p>HTML5は次世代のHTML標準です。 標準の定式化は、2014年10月にWorld Wide Web Consortium（W3C）によって完成されました。 HTML5は、モバイルデバイスでマルチメディアをサポートするように設計されています。</p><p>HTML5は、W3CとWHATWGの協力の結果です。WHATWGは、Web Hypertext Application Technology WorkingGroupを指します。</p><p>WHATWGはWebフォームとアプリケーション専用であり、W3CはXHTML2.0専用です。 2006年、両当事者は協力して新しいバージョンのHTMLを作成することを決定しました。</p><p>HTML5のいくつかの興味深い新機能：<br/>ペイント用のキャンバス要素<br/> メディア再生用のビデオおよびオーディオ要素<br/>ローカルオフラインストレージのサポートの向上<br/> 記事、フッター、ヘッダー、ナビゲーション、セクションなどの新しい特別なコンテンツ要素<br/> カレンダー、日付、時刻、メール、URL、検索などの新しいフォームコントロール</p>');
INSERT INTO `think_article_category` VALUES (65, 'CSS', 'CSS', '', 62, 0, 1, 0, 'CSS、CSS3、CSSチュートリアル', 'CSS列には、主にCSSチュートリアル、CSS3、Div + CSSチュートリアル、Web標準チュートリアル、ブラウザー互換性チュートリアル、CSSレイアウト例、およびその他のWeb技術コンテンツが含まれています。', '/uploads/images/20211019\\7f871236bf79206688d2b385db022403.jpg', '<h1>CSS</h1><p>CSSは、HTML（標準のユニバーサルマークアップ言語のアプリケーション）やXML（標準のユニバーサルマークアップ言語のサブセット）などのドキュメントスタイルを表現するために使用されるコンピューター言語です。 CSSは、Webページを静的に変更できるだけでなく、さまざまなスクリプト言語を使用してWebページの要素を動的にフォーマットすることもできます。</p><p><br/></p><p>CSSは、Webページの要素位置のレイアウトをピクセルレベルで正確に制御でき、ほぼすべてのフォントサイズのスタイルをサポートし、Webページのオブジェクトとモデルのスタイルを編集する機能を備えています。</p><p><br/></p><p>CSSは、HTMLマークアップ言語のスタイルの説明を提供し、要素の表示方法を定義します。 CSSは、Webデザインの分野における画期的な製品です。 小さなスタイルを変更して、それに関連するすべてのページ要素を更新するために使用できます</p>');
INSERT INTO `think_article_category` VALUES (66, 'XML/XSLT', 'XML/XSLT', '', 62, 0, 1, 0, 'XML、XSLT', 'XML / XSLT列には、主にXML / XSLT入門チュートリアル、メソッドスキル、サンプルチュートリアル、文法、およびその他のWeb技術コンテンツが含まれています。', '/uploads/images/20211019\\1f83e9599df3c43ffb29f14aeaa83779.jpg', '<h1>XML/XSLT</h1><p>XMLは、コンピュータープログラム間で生データを交換するためのシンプルで標準的な方法です。 その成功は、人々が簡単に読み書きできるということではありませんが、さらに重要なことに、アプリケーションシステム間の情報交換を根本的に解決します。</p><p><br/></p><p>XSLTは、拡張スタイルシート変換言語の外国語の略語です。これは、XML（標準ユニバーサルマークアップ言語のサブセット）ドキュメントを変換するための言語です。</p><p><br/></p><p>XML / XSLT列は、XML / XSLT関連の入門的な基本チュートリアル、言語の記述、メソッドスキルなど、および問題の解決策を理解して学習するのに役立ちます。</p>');
INSERT INTO `think_article_category` VALUES (67, '心得技巧', 'ウェブサイトのスキル', '', 62, 0, 2, 0, 'ウェブページ作成チュートリアル、ウェブデザインチュートリアル、ウェブページチュートリアル、ウェブページ作成', 'ウェブページ作成のヒントとテクニックのコラムでは、主にウェブページ作成プロセスの経験とスキル、および発生した問題の解決策の概要を共有しています。', '/uploads/images/20211019\\d82226d148f2da4a289e354ab77d6c65.jpg', '<h1>ウェブサイトのスキル</h1><p>ウェブページ制作は、ウェブサイトプランナー、ウェブプログラマー、ウェブデザイナーなどであり、さまざまなウェブプログラム開発技術とウェブデザイン技術を適用して、企業、機関、企業、個人向けのグローバルインターネット上にサイトを構築します。ホスティングおよびその他のサービスの総称。</p><p><br/></p><p>Webページの作成は、企業がeコマースを開発するためのインフラストラクチャおよび情報プラットフォームです。Webサイトを離れずに（または単にサードパーティのWebサイトを使用して）eコマースについて話すことは不可能です。 Webページの制作は、訪問者が視覚的な喜びを感じることができるように、訪問者の注意を十分に引き付けることができなければなりません。 したがって、Webページを作成するときは、Webサイトの全体的なデザインを、関連するWebデザインの原則と緊密に統合する必要があります。</p><p><br/></p><p>このコラムは主にウェブページ作成チュートリアル、問題解決策などをまとめたものです。</p>');
