INSERT INTO `think_article_category` VALUES (69, 'bios', 'bios', '', 68, 0, 2, 0, 'BIOS設定、BIOS設定、uディスクの起動、パスワード設定、BIOS設定、ハードディスクの起動', 'BIOSコラムは、主にBIOS設定チュートリアル、BIOSスタートアップチュートリアル、BIOS問題解決方法などを提供します。', '/uploads/images/20211019\\240ad7ab0d6833cbdc5bc4e4c5d3f14d.jpg', '<h1>bios</h1><p>BIOSチャネルは、BIOSセットアップチュートリアル、BIOSスタートアップチュートリアル、およびさまざまな問題の解決策を提供します。 内容には、BIOS設定、USBブート方法の設定、その他のブート方法とシーケンス、工場設定の復元、BIOSアップグレード、パスワード設定、さまざまな問題解決方法などが含まれます。 Samsung、Asus、Lenovo、Toshiba、HP、その他のコンピュータータイプを含む</p>');
INSERT INTO `think_article_category` VALUES (70, '系统安装', 'システムのインストール', '', 68, 0, 2, 0, 'システムインストールチュートリアル、CentOS、ワンクリックシステムインストール、Ubuntu、Debian', 'システムインストールの列には、主にシステムのインストール、システムの再インストール、および一般的な問題の解決策が含まれています。', '/uploads/images/20211019\\8904b4800382eaae853aeb383f04f3c9.png', '<h1>システムのインストール</h1><p>システムインストールチャネルは主に、Debian、Ubuntu、CentOS、Windowsシリーズ、Linux、VMware仮想マシン、システムインストーラー、サードパーティのシステムインストールソフトウェアなどのシステムインストールチュートリアルを含む、システムインストール、システムの再インストール、および一般的な問題解決に関するチュートリアルを提供します。詳細で包括的なワンクリックシステムインストールチュートリアルのコレクション</p>');
