INSERT INTO `think_article_category` VALUES (73, 'LINUX', 'LINUX', '', 68, 0, 2, 0, 'LINUX、Linuxシステムのダウンロード、Linuxのインストール、CentOS', 'LINUXの列には、主にLINUXシステムのインストールチュートリアル、LINUXシステムのダウンロード、システム構成、およびLINUXで発生した問題の解決策の概要が記載されています。', '/uploads/images/20211019\\d1af8036b069e7fde20253dcacd69ae6.jpg', '<h1>LINUX</h1><p>LINUXチャネルは、LINUXシリーズのシステムのインストールとアップグレードとアクティベーションのチュートリアル、LINUXの構成と使用方法、LINUXシステムのダウンロード、サーバーのインストールと使用、CentOS、tomcat、jdk、php、mysql、git、unzipなどのインストールと使用のチュートリアルを提供します。 。、そして誰もがLINUXの問題を解決するのを手伝ってくださいインストールと使用中に遭遇するさまざまな問題！</p>');
INSERT INTO `think_article_category` VALUES (74, 'RedHat/Centos', 'RedHat/Centos', '', 68, 0, 2, 0, 'RedHat、Centos、centosインストール、centosダウンロード', 'RedHat / Centos列には、主にRedHat / Centosシステムのインストールチュートリアル、RedHat / Centosシステムのダウンロード、システムの使用構成、および発生した問題の解決策の概要が表示されます。', '/uploads/images/20211019\\caefcb39d64ba2c46f292deea4811f6d.jpg', '<h1>RedHat/Centos</h1><p>RedHat / Centosチャネルは、RedHat / Centosシリーズシステムのインストールとアップグレードのチュートリアル、Centosの構成方法、RedHat / Centosの使用法のチュートリアル、RedHat / Centosシステムのダウンロードを提供し、RedHat / Centosのインストールと使用で発生するさまざまな問題の解決に役立ちます。</p>');
INSERT INTO `think_article_category` VALUES (75, 'Ubuntu/Debian', 'Ubuntu/Debian', '', 68, 0, 2, 0, 'Ubuntu、Debian、Ubuntuのインストール、Ubuntuのダウンロード', 'Ubuntu / Debianの列には、Ubuntu / Debianシステムのインストールチュートリアル、Ubuntu / Debianシステムのダウンロード、構成方法、およびUbuntu / Debianで発生した問題の解決策の概要が記載されています。', '/uploads/images/20211019\\afe91674002f959a2e8894cc8bcf02e9.jpg', '<h1>Ubuntu/Debian</h1><p>Ubuntu / Debianチャネルは、Ubuntu / Debianシリーズのシステムインストール+アップグレードのチュートリアル、Ubuntu / Debianの構成と操作方法、Ubuntu / Debianシステムのダウンロードなどを提供し、Ubuntu /のインストールと使用で発生するあらゆる種類の問題の解決に役立ちます。 Debian！</p>');
INSERT INTO `think_article_category` VALUES (76, 'Fedora', 'Fedora', '', 68, 0, 2, 0, 'Fedora、fedoraダウンロード、fedoraインストールチュートリアル', 'Fedoraコラムは、主にFedoraシステムのインストールチュートリアル、Fedoraシステムのダウンロード、システム使用構成、およびFedoraで発生した問題の解決策の要約を提供します。', '/uploads/images/20211019\\f5e4dfc282cd42e4e228a7cea5ba7f31.jpg', '<h1>Fedora</h1><p>Fedora Channelは、Fedoraシリーズのシステムのインストールとアップグレード、Fedoraの構成と操作方法、Fedoraシステムのダウンロード、サーバーのインストールと使用のチュートリアルに関するチュートリアルを提供し、Fedoraのインストールと使用で発生するあらゆる種類の問題の解決に役立ちます。</p><p><br/></p><p>FedoraはLinuxディストリビューションです</p>');
INSERT INTO `think_article_category` VALUES (77, 'Unix/BSD', 'Unix/BSD', '', 68, 0, 2, 0, 'Unix、BSD', 'Unixは、1970年代初頭に登場したオペレーティングシステムです。ネットワークオペレーティングシステムであるだけでなく、スタンドアロンオペレーティングシステムとしても使用できます。 Unixは、開発プラットフォームおよびデスクトップオペレーティングシステムとして広く使用されており、主にエンジニアリングアプリケーションや科学計算分野で使用されています。', '', '<p>\n    <br/>\n</p>');
INSERT INTO `think_article_category` VALUES (78, '苹果MAC', 'Apple MAC', '', 68, 0, 2, 0, 'Apple MAC、macOS、Macbook', 'Macintosh（略してMac）は、1984年以来Appleによって開発された個人用消費者向けコンピュータであり、iMac、Mac mini、Macbook Air、Macbook Pro、Macbook、MacProなどのコンピュータが含まれます。 独立したmacOSシステムを使用してください。最新のmacOSシリーズはNeXTシステムに基づいて開発されており、互換性をサポートしていません。 これは完全で独立したオペレーティングシステムです。', '', '<p>\n    <br/>\n</p>');
