  `t` tinyint(1) NULL DEFAULT 1 COMMENT '1:足球 2:篮球',
  `category_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '分类名',
  `pinyin` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '拼音(url地址)',
  `img` varchar(150) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT '' COMMENT '分类头像',
  `caiji_biao_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT '' COMMENT '分类对应远程数据库表的名字',
  `is_caiji` tinyint(1) NULL DEFAULT 0 COMMENT '1:采集 0:不采集',
  `pid` int(5) NULL DEFAULT 0 COMMENT '父分类ID,0为顶级目录',
  `top_id` int(5) NULL DEFAULT 0 COMMENT '顶级id',
  `sort` int(10) NULL DEFAULT 0 COMMENT '排序，越小越在前面',
  `status` tinyint(1) NULL DEFAULT 1 COMMENT '1显示 0不显示',
  `show_navigation` tinyint(1) NULL DEFAULT 0 COMMENT '是否在导航栏显示',
  `support` tinyint(1) NULL DEFAULT 0 COMMENT '是否推荐栏目',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT '' COMMENT '关键词',
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL COMMENT '描述',
  `tag_id` int(10) NULL DEFAULT 0 COMMENT '绑定的标签',
  `team_id` int(10) NULL DEFAULT 0 COMMENT '外部球队id(用于直播采集)',
  PRIMARY KEY (`category_id`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `pinyin`(`pinyin`) USING BTREE,
  INDEX `pid`(`pid`) USING BTREE,
  INDEX `tag_id`(`tag_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 717 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

